(18, '王宝强 Baoqiang Wang', '男', '双子座', '1984-05-29 00:00:00', '中国,河北,邢台', '演员 / 配音 / 导演', '', '王宝强，中国男演员。王宝强6岁时开始练习武术，8岁-14岁在河南嵩山少林寺做俗家弟子，之后来到北京闯天下，在各个剧组当武行做群众演员。命运似乎很眷顾这个看上去普普通通的孩子，16岁时，王宝强被导演李扬挑中，主演独立电影《盲井》，这部电影让他一夜之间从武行变成金马奖最佳新人。此外，王宝强还凭《盲井》获得了法国第五届杜威尔电影节“最佳男主演奖”以及第二届曼谷国际电影节“最佳男演员奖”。　　2004年，参演冯小刚贺岁剧《天下无贼》，名声大噪，其朴实的个性...(展开全部)', 77, '79,78,81,80,82', '2018-12-28 06:25:23', NULL),
(19, '曾江 Kenneth Tsang', '男', '处女座', '1935-09-02 00:00:00', '香港', '演员 / 导演 / 编剧', '', '曾江：香港影坛一代“嚣”雄 曾江向来自负，外表折射出来是嚣张孤傲。最出名的事件就要数他在媒体前愤言：“香港演员没一个专业的！”当时他受到好莱坞电影公司青眯，既和布鲁斯南合演《007》，又与成龙周润发斗戏，大赚美金，正是意气风发时。 而他加入无线《真情》剧组，对甘草演员余慕莲要求甚多，对方达不到要求，他当场粗口炮轰至余慕莲大哭，更是被业内业外指“癫狂症发作”。 或许正因为如此性格，曾江演起愤世嫉俗的东邪黄药师才那般的得心应手，并大获佳评。 如今，曾...(展开全部)', 83, '84,85,86,87,88', '2018-12-28 06:25:23', NULL),
