(40, '亚历克·鲍德温 Alec Baldwin', '男', '白羊座', '1958-04-03 00:00:00', '美国,纽约,长岛,马萨佩奎', '演员 / 配音 / 制片人 / 编剧 / 导演', 'Alexander Rae Baldwin III (本名)', '亚历克·鲍德温，美国著名影视演员，曾在纽约大学攻读戏剧，毕业后日间出演电视肥皂剧，晚间加盟莎翁舞台剧表演。80年代初开始活跃在电视荧屏上，参加了《医生》（The Doctors）和《Knots Landing》等电视系列剧的拍摄。此后，亚历克-鲍德温正式步入影坛，先后在《永远的璐璐》（Forever,Lulu）、《甲壳虫汁》（Beetle Juice）、《乌龙密探摆黑帮》（Married to the Mob）和《抓狂电台》（Talk Radio）等多部影片中出演一些比较严肃的角色。1990年，亚历克-鲍德温第一次出现在...(展开全部)', 165, '166,167,168,169,170', '2018-12-28 06:26:23', NULL),
(41, '布莱德利·库珀 Bradley Cooper', '男', '摩羯座', '1975-01-05 00:00:00', '美国,宾夕法尼亚,费城', '演员 / 制片人 / 导演 / 配音 / 编剧', '', 'Bradley Cooper在费城出生，却在Jenkintown长大，他的妈妈是一个意大利裔人，爸爸是个爱尔兰裔美国股票经纪人，所属于Merrill Lynch公司。1993年，Cooper从日耳曼学院毕业后就上了Villanova University，但是在大一的时候却突然转学到了Georgetown University，并顺利拿到英语学士学位。因为Cooper的法语相当流利，所以他又在大学毕业后置身前往法国呆了六个月，随后返乡修读戏剧、表演 专业并顺利在一家纽约演员工作室工作。　　Cooper的职业生涯开端应该从1998年的《欲望都...(展开全部)', 171, '172,173,174,175,176', '2018-12-28 06:26:24', NULL),
(42, 'Lady Gaga', '女', '白羊座', '1986-03-28 00:00:00', '美国,纽约,曼哈顿', '演员 / 导演 / 配音', 'Stefani Joanne Angelina Germanotta (本名) / GaGa (昵称)', 'Lady GaGa，欧美流行音乐天后。4岁的时候，她就能靠双耳聆听便学会钢琴弹奏；13岁写下第一首抒情创作歌曲；14岁在公开场合拿起麦克风演唱；17岁被纽约大学音乐系提前录取（这种特殊名额全世界只有20个），但因觉得学校不适合而退学，并在酒吧以性感衣着跳舞唱歌。GaGa曾签约Def Jam唱片公司，以真名推出首张专辑，但三个月后解约。到了20岁，她受到了知名唱片公司Interscope Records的赏识，立马签入旗下帮歌手和乐队写歌谱曲。2008年正式出道的她迅即掀起热潮，两张专辑的全球...(展开全部)', 177, '178,179,180,181,182', '2018-12-28 06:26:26', NULL),
