(207, '塞缪尔·杰克逊 Samuel L. Jackson', '男', '射手座', '1948-12-21 00:00:00', '美国,华盛顿,哥伦比亚特区', '演员 / 配音 / 制片人', 'Samuel Leroy Jackson (本名) / Mr Cool (昵称) / King of Cool (昵称) / Sam (昵称)', '塞缪尔·杰克逊1948年12月21日出生于美国华盛顿，在田纳西长大，从小就对课业非常的认真，并且进入位于亚特兰大的摩尔浩斯学院读建筑，后来才转到了戏剧系，以戏剧艺术学士的学位毕业。　　毕业后，塞缪尔·杰克逊搬到纽约，寻找演出的机会，在纽约的前10年之中，他过得并不好，想演电影却四处碰壁，只好先在小荧幕上演电视剧来糊口，或在影片中出任小得不能再小的角色赚取微薄的薪水，顺便等候任何能让他演电影的机会。1981年，他出演了《丛林热》中那位嗑药成瘾的流浪汉，为...(展开全部)', 768, '769,770,771,772,773', '2018-12-28 06:32:22', NULL),
(208, '布拉德·伯德 Brad Bird', '男', '天秤座', '1957-09-24 00:00:00', '美国,蒙大拿州,卡利斯佩尔', '导演 / 编剧 / 配音 / 制片人 / 演员', 'Phillip Bradley Bird (本名)', '布拉德·伯德(全名Phillip Bradley Bird)是著名的动画导演，他的作品包括《超人总动员》、《正义铁巨人》等，而且他导演的《料理鼠王》在2007年上映后也获得了如潮好评。　　布拉德·伯德在11岁到13岁的时候就完成了他的第一个动画短片，在14岁的时候，他受到迪士尼公司的注意，并受到迪士尼九大元老之一的Milt Kahl的指导。后来他在加州艺术学院学习，并在那里结识了约翰·拉斯特(John Lasseter)。后来拉斯特邀请伯德执导了《超人总动员》，他也因此获得了奥斯卡最佳动画长片...(展开全部)', 774, '775,776,777,778,779', '2018-12-28 06:32:22', NULL),
(209, '索菲亚·布什 Sophia Bush', '女', '巨蟹座', '1982-07-08 00:00:00', '美国,加利福尼亚州,帕萨迪纳', '演员 / 配音 / 导演', 'Sophia Anna Bush (本名) / Sophie (昵称) / Soph (昵称)', 'Sophia Bush 1982年出生在美国加州的巴沙迪那市，父亲是一位小有名气的广告摄影师，母亲则经营着一家摄影工作室，索菲亚是家中的独女。高中毕业那年她是家乡帕沙迪纳市历史悠久的新年玫瑰花车大游行活动的“玫瑰皇后”，美貌可谓远近闻名。2002年她通过与Ryan Reynolds合演的喜剧片《留级之王》登上大银幕，同时在南加州大学主修新闻学、副修戏剧，然而三年级时因为得到WB青春剧《One Tree Hill》中的角色而放弃了学业。　　Sophia Bush原本还被选定同施瓦辛格一起主演2003年...(展开全部)', 780, '781,782,783,784,785', '2018-12-28 06:32:23', NULL),
