(219, '达科塔·范宁 Dakota Fanning', '女', '双鱼座', '1994-02-23 00:00:00', '美国,乔治亚州,科尼尔斯', '演员 / 配音 / 导演 / 编剧', 'Hannah Dakota Fanning (本名) / Kota (昵称)', '达科塔·范宁1994年2月23日出生在美国佐治亚州Conyers，2000年开始涉足演艺界。在她跨入电影界前，就开始在自家屋边表演。她性格活泼，经常把毛毯塞进衬衣里假装怀孕，而她的妹妹艾丽(Elle)，现在也是演员。达科塔还去过家附近一个剧场，在那里每周孩子们都要为他们的家长献上一出戏。达科塔出色的表现引起了剧场所有者的注意，并建议她的父母安排见经纪人，他们认为她非常地有天赋。范宁一家在远离佐治亚的洛杉矶呆了6周。在那里达科塔得到了她的第一份工作，在众多的...(展开全部)', 833, '834,835,836,837,838', '2018-12-28 06:33:13', NULL),
