(227, '格里芬·邓恩 Griffin Dunne', '男', '双子座', '1955-06-08 00:00:00', '美国,纽约', '演员 / 导演 / 制片人', 'Thomas Griffin Dunne (本名)', '1955年出生。79年就尝试过自己做制片人，比如《神魂颠倒 Head Over Heels》，在这部片中他也有角色演出。83年又做了《情到深时 Baby, It\'s You》的制片人。到了85年，他在自己主演的电影《下班后 After Hours》里又担任了制片人，作为演员还拿到了金球奖提名。此后又在《不设限通缉 Running on Empty》、《情挑六月花 White Palace》、《浪漫一生又何妨 Once Around》、《蟑螂总动员 Joe\'s Apartment》等片担任制片人，一直到96年。　　96年他客串《欢乐一家亲》拿到了艾美奖...(展开全部)', 862, '863,864,865,866,867', '2018-12-28 06:33:17', NULL),
(228, '凯莉·詹娜 Kylie Jenner', '女', '狮子座', '1997-08-10 00:00:00', '美国,加利福尼亚州,洛杉矶', '演员 / 导演', '', '凯莉·詹纳首次在纸的“最美丽人物”系列文章与她的姐姐肯达尔。 她开始了她的模特生涯与西尔斯行“粉碎你的风格” ，并做照片拍摄与OK！杂志， 青少年的时尚，和摄影师尼克Saglimbeni 。詹纳还模仿她的表姐娜塔莎的服装公司。她曾表示有兴趣充当好，但解释说，大学是一个更高的优先级。　　詹纳于2011年纽约时装周为蓝本艾薇儿收集修道院黎明跑道。她为蓝本在洛杉矶正式的Hello Kitty推出的永远21 。 十七选择詹纳和她的妹妹肯德尔作为2011年款明星和新的“风格大使”的杂志...(展开全部)', 868, '869,870,871,872,873', '2018-12-28 06:33:17', NULL),
(229, '凯蒂·霍尔姆斯 Katie Holmes', '女', '射手座', '1978-12-18 00:00:00', '美国,俄亥俄州', '演员 / 制片人 / 导演', 'Kate Noelle Holmes (本名)', '凯蒂·赫尔姆斯，美国女演员，凭在1998年播映的电视剧《恋爱时代》(Dawson\'s Creek)打响名头，以电影《天赋》的演出为人熟悉。她在2006年和电影明星汤姆·克鲁斯结婚。父亲是一位事业成功的婚姻纠纷律师。由于小时候就学过钢琴和唱歌，凯蒂于是决心朝演艺圈发展。初中毕业后，凯蒂报名参加了托莱多模特学校。在那里，她接受了专业的模特训练，并获邀参加了一年一度在纽约举行的国际模特大赛。模特大赛过后，一位有眼光的经纪人建议凯蒂去洛杉矶寻找机会。幸运的是，凯蒂在到洛...(展开全部)', 874, '875,876,877,878,879', '2018-12-28 06:33:20', NULL),
(230, '盖瑞·罗斯 Gary Ross', '男', '天蝎座', '1956-11-03 00:00:00', '美国,加利福尼亚州,洛杉矶', '编剧 / 导演 / 制片人 / 演员', '', '曾四度荣获奥斯卡奖提名。他以编剧身份开始自己的职业生涯，首部作品是原创剧本《大》。该片后来由汤姆•汉克斯主演，为罗斯带来了第一次奥斯卡奖提名。接着，罗斯将关注点投放到他钟爱的美国政坛题材，并酝酿了卡普拉风格的喜剧剧本《雾水总统》，由此再度获得奥斯卡奖提名，并夺得倍受尊重的编剧工会奖保罗•萨尔文奖。　　1998年，罗斯踌躇满志地完成了他的导演处女作《欢乐谷》，受到业内外一致赞誉。2003年，他自编自导了深受关注的《奔腾年代》，由托比•马奎尔，...(展开全部)', 880, '881,882,883,884,885', '2018-12-28 06:33:20', NULL),
