(240, '莎拉·保罗森 Sarah Paulson', '女', '射手座', '1974-12-17 00:00:00', '美国,佛罗里达州,坦帕', '演员', 'Sarah Catharine Paulson (本名)', '莎拉·保罗森在她12岁那年完成了她的处子秀。在完成学业之后，她开始在纽约的舞台上开始了她的演艺事业，于1994年完成了个人的荧屏处子秀《Law & Order》，1995年出演《Merlyn Temple》和《American Gothic》，她以《Levitation》一片第一次登上荧幕；1999年她出演Garry Marshall的戏剧《The Other Sister》，同年她再一次回到电视荧屏中来，在《Jack and Jill》中饰演Elisa Cronkite。　　在2004年开播的《绝望的主妇》中，她饰演了Lydia一角。　　2007年，她凭借《日落大道...(展开全部)', 930, '931,932,933,934,935', '2018-12-28 06:33:32', NULL),
