(243, '理查德·阿米蒂奇 Richard Armitage', '男', '狮子座', '1971-08-22 00:00:00', '英国,莱斯特郡,莱斯特', '演员 / 配音', 'Richard Crispin Armitage (本名)', '理查德·阿米蒂奇，英国演员。曾就读于考文垂的Brockington和Pattison中学，后入伦敦音乐戏剧艺术学院学习表演，17岁时加入布达佩斯马戏团，六星期后取得英国演员协会会卡。他的第一个重要角色是在2002年BBC制作的电影《sparkhouse》中扮演农场工人John Standring ，之后在电视剧Between the Sheets》，《Cold Feet》（series 5），《Ultimate Force 》（Series 2）出演各种小配角。2004年，他主演了根据伊丽莎白·盖斯凯尔小说改编的电视剧《南方与北方》，因其出色演绎了来自...(展开全部)', 948, '949,950,951,952,953', '2018-12-28 06:33:34', NULL),
