(247, '凯特·布兰切特 Cate Blanchett', '女', '金牛座', '1969-05-14 00:00:00', '澳大利亚,维多利亚,墨尔本', '演员 / 配音 / 制片人 / 导演', 'Catherine Elise Blanchett (本名)', '凯特·布兰切特（Cate Blanchett，1969年5月14日—），澳大利亚电影演员。原名凯瑟琳·埃利斯·布兰切特（Catherine Elise Blanchett）。出生于澳大利亚墨尔本，父亲是美国海军军官，母亲是澳大利亚的老师。毕业于悉尼国家戏剧学院。她饰演过的角式的形象不少都很鲜明，如伊丽莎白女王、魔戒中的凯兰崔尔及夺宝奇兵之水晶骷髅国中的艾琳娜·史帕可。　　凯特·布兰切特认为自己今天的成功是因为运气，是命运使她能得到一个又一个极富挑战性的角色。《伊莉莎白》的导演谢加·凯...(展开全部)', 967, '968,969,970,971,972', '2018-12-28 06:33:37', NULL),
