(250, '杨幂 Mi Yang', '女', '处女座', '1986-09-12 00:00:00', '中国,北京', '演员 / 配音 / 动作捕捉 / 制片人', '', '杨幂，1986年9月12日出生于北京市，中国女演员、乐歌手、影视制片人。毕业于北京电影学院表演系2005级本科班。 在2009年4月的“80后新生代娱乐大明星”评选活动中，杨幂成为内地新“四小花旦”之一。　　2006年因出演《神雕侠侣》中“小东邪”郭襄而受到观众的关注，2008年凭借《王昭君》提名第24届金鹰奖观众喜爱的电视剧女演员奖，2009年又凭借《仙剑奇侠传三》而人气飙升。2011年因为在穿越剧《宫》（又名《宫锁心玉》）中扮演洛晴川一角而获得了更高的人气，凭借该角色获...(展开全部)', 976, '981,978,980,979,977', '2018-12-28 06:34:16', NULL),
(251, '刘杰 Jie Liu', '男', '水瓶座', '1968-02-18 00:00:00', '中国,天津', '制片人 / 导演 / 编剧 / 摄影 / 演员', '', '刘杰，中国大陆著名导演、摄影师。父母为农业大学教授，幼年曾随父母下放农村劳动。1975—1986在河北省保定市就读中小学。从小热爱绘画，1986年高中毕业报考美术学院时，偶然看了电影《黄土地》，遂放弃美术理想，于次年考入北京电影学院摄影系。1991年以优异的成绩毕业于北京电影学院摄影系本科,获文学学士学位。1992年进入英文中国妇女杂志社任摄影记者，次年离职。1993至今，职业电影摄影师，电影制片人，电影导演。　　1992年担任《冬春的日子》制片人、摄影；1999年至200...(展开全部)', 982, '983,984,985,986,987', '2018-12-28 06:34:18', NULL),
