(253, '李鸿其 Hong-Chi Lee', '男', '金牛座', '1990-05-10 00:00:00', '台湾,新北', '演员', '', '李鸿其，1990年5月10日出生于台湾新北市，中国台湾影视男演员，就读于中国文化大学戏剧系。　　2013年，出演个人首部电视剧《拥抱刺猬》踏入演艺圈。2015年，主演剧情片《醉·生梦死》获得关注，并凭借该片获得第52届台湾电影金马奖最佳新人奖以及第17届台北电影节最佳男主角。2016年，主演悬疑片《地球最后的夜晚》 ；同年，出演由何蔚庭执导的电影《幸福城市》和由刘杰执导的电影《宝贝儿》。2017年，出演喜剧片《缝纫机乐队》 ，以及由东野圭吾畅销小说改编的中国版同名电...(展开全部)', 994, '995,996,997,998,999', '2018-12-28 06:34:32', NULL),
