(256, '米雪 Michelle Mee', '女', '处女座', '1955-09-02 00:00:00', '中国,香港', '演员 / 配音', 'Catherina Yim / Michelle Yim', '米雪，原名严惠玲，生于香港，祖籍广东东莞，香港女演员，现为无线电视代理人合约女艺员。艺名米雪取自其英文名“Michelle”。她是曹达华的干女儿，男友为足球员尹志强，妹妹严惠明（雪梨）亦为演员。　　1976年至1990年是米雪演艺生涯的高峰期，米雪的百余部影视作品中，大部分是在这一时期拍摄的。 至今，米雪依然活跃在港台演艺圈内，偶尔会扮演反面角色。扮演反面角色的演员，往往在现实生活中也会受到人们的唾弃。但演坏人的米雪在现实生活中不仅不会被唾弃，反而得到友...(展开全部)', 1013, '1014,1015,1016,1017,1018', '2018-12-28 06:34:50', NULL),
(257, '王盛德 Russell Wong', '男', '双鱼座', '1963-03-01 00:00:00', '美国,纽约,特洛伊', '演员 / 制片人', 'Russell Girard Wong (本名)', 'Russell Girard Wong (王盛德, pinyin: Wáng Shèngdé; born March 1, 1963) is an American actor and photographer, as well as the brother of actor/model Michael Wong.　　The sixth of seven children, Wong was born in Troy, New York; the son of Chinese American restaurateur William Wong and an American artist of Dutch and French descent, Connie Van Yserloo.[1][2] His family moved to Albany when he was a baby, where his father ran a restaurant...(展开全部)', 1019, '1020,1021,1022,1023,1024', '2018-12-28 06:34:51', NULL),
(258, '陈楚生 Chusheng Chen', '男', '狮子座', '1981-07-25 00:00:00', '海南,三亚', '演员', '', '陈楚生，1981年7月25日出生于海南，中国当红原创歌手，华语乐坛最具影响力男歌手之一，在各大权威音乐奖项中多次获奖，更三度蝉联中歌榜“最佳创作歌手奖”，娴熟的吉他和天籁般的音色使他成为舞台上为数不多的灵魂歌者。因夺得2007年“快乐男声”全国总冠军而名声大震，当年的一曲《有没有人告诉你》更成为家喻户晓的佳作。签约华谊公司后的他，歌唱事业一路攀升。因其“零负面”的绿色艺人形象，已有37首音乐作品被奥运、亚运、青奥会等国际性体育赛事、大牌电影、各电视台节...(展开全部)', 1025, '1026,1027,1028,1029,1030', '2018-12-28 06:34:55', NULL),
(259, '张震 Chen Chang', '男', '天秤座', '1976-10-14 00:00:00', '台湾,台北', '演员 / 配音 / 导演', 'Chang Chen / Chan Cheung / Zhen Zhang', '张震，著名电影演员，1976年10月14日生于台北。父亲张国柱亦为知名电影演员。母亲赵欣然，哥哥张翰。张震从15岁主演电影《牯岭街少年杀人事件》开始，便引起了电影团专业人士和影迷的关注。在该电影中，他与父亲一同演出。张震亦正亦邪、成熟中略带孩子气的特质，正是时下年轻艺人身上所欠缺的。　　他曾与女艺人路嘉欣相恋六年。后来张震寄了一张明信片与她结束了这段关系。代表作有《春光乍泄》、《卧虎藏龙》、《最好的时光》、《赤壁》等，曾多次获国际电影节提名，其中20...(展开全部)', 1031, '1032,1033,1034,1035,1036', '2018-12-28 06:34:57', NULL),
