(265, '铁政 Zheng Tie', '男', '狮子座', '1985-01-01 00:00:00', '中国,陕西,西安', '演员', '', '演艺经历:　　1997年 参加中国人民解放军建军70周年大型文艺晚会,受到国家领导人的接见 2000年 代表中国红星舞蹈团出访瑞士,西班牙,希腊，罗马尼亚等欧洲五国进行对外文化交流的演出 2001年 参加中央电视台春节联欢晚会的演出 2008年 参与演出话剧《金大班班的最后一夜》，并赴台湾地区进行访问演出 2009年 随《80后》剧组赴日本参加第22届东京国际电影节　　编辑本段主要影视作品:　　四十集电视连续剧《风雨西关》 饰演:谢天豪 四十集电视连续剧《大屋的丫鬟们》 饰演:楚...(展开全部)', 1058, '1059,1060,1061,1062,1063', '2018-12-28 06:35:06', NULL),
(266, '王力宏 Lee-Hom Wang', '男', '金牛座', '1976-05-17 00:00:00', '美国,纽约,罗切斯特', '演员 / 配音 / 导演 / 音乐 / 编剧', 'Alexander Wang (本名) / Leehom Alexander Wang', '王力宏第一次出现在台湾国语歌坛的时候，公认的封号“台湾第一优质偶像”，就好像是一个歌坛的模范生似的。为王力宏健康、聪明、帅气、多才多艺的形象，下了一个最切合的注解。多年来在歌坛的顺利发展也证实了他的实力。　　电影方面也有尝试，如《雷霆战警》、《拳神》和与日本影人合作的《月光游侠》等，但反响平平。导演李安仍旧看好这个年轻人，在自己获得奥斯卡最佳导演之后的第一部作品《色·戒》中，请王力宏出演男二号，和梁朝伟搭戏。2009年加盟成龙影片《大兵小将》...(展开全部)', 1064, '1065,1066,1067,1068,1069', '2018-12-28 06:35:06', NULL),
(267, '黄晓明 Xiaoming Huang', '男', '天蝎座', '1977-11-13 00:00:00', '中国,山东,青岛', '演员 / 配音', '', '黄晓明，1977年11月13日出生于山东省青岛市，毕业于北京电影学院。中国内地著名男演员、歌手、投资人，中国最年轻的影帝大满贯获得者。2001年，凭借电视剧《大汉天子》而成名。之后主演的《新上海滩》、《06版神雕侠侣》等热播剧，在两岸三地创下高收视率。2007年后主演电影《神枪手》、《风声》等。2017年参加湖南卫视的真人秀《中餐厅》，该节目获得2016-2017年度最具价值电视综艺奖。同年12月18日，作为特别主演出演的古装权谋剧《琅琊榜之风起长林》，在东方卫视、北京卫视...(展开全部)', 1070, '1071,1072,1073,1074,1075', '2018-12-28 06:35:06', NULL),
(268, '保罗·菲利普·克拉克 Paul Philip Clark', '男', '', NULL, '', '', '', '', 1076, '', '2018-12-28 06:35:06', NULL),
(269, '章子怡 Ziyi Zhang', '女', '水瓶座', '1979-02-09 00:00:00', '中国,北京', '演员 / 配音 / 制片人', 'Zhang Zi-Yi(本名)', '章子怡，1979年2月9日出生于中国北京，11岁进入北京舞蹈学院附中舞蹈科，网上流传的章子怡在青少年时期拍摄的一些舞蹈视频，崭露了她少年时代的舞蹈才华。后来进入中央戏剧学院戏剧系，被张艺谋发掘，于1998年担任电影《我的父亲母亲》的女主角（招娣），此片获得2000年柏林电影节银熊奖。1999年，她又演出台湾导演李安执导的电影《卧虎藏龙》，担任女主角（玉娇龙）与周润发、杨紫琼、郎雄等港台资深影人共同演出，《卧虎藏龙》获得次年美国奥斯卡金像奖最佳外语片奖。随着《...(展开全部)', 1077, '1078,1079,1080,1081,1082', '2018-12-28 06:35:10', NULL),
