(369, '宋佳 Jia Song', '女', '天蝎座', '1980-11-13 00:00:00', '中国,黑龙江,哈尔滨', '演员 / 配音 / 主持人', '송가', '宋佳，黑龙江省哈尔滨市人，中国内地知名女演员，毕业于上海戏剧学院表演系，因有同名的女前辈宋佳，故被大家称为“小宋佳”。其代表影视作品有《好奇害死猫》、《中国往事》、《闯关东》、《爱情呼叫转移》等。　　小宋佳本是音乐学校科班出身，2000年高考前夕，凭借出色的柳琴演奏成绩。宋佳提前拿到了沈阳音乐学院的大学录取通知书，但后来因高人指点改投上海戏剧学院，并且最终如愿以偿，进入表演系。 “音乐一直是我的一个梦想。”小宋佳介绍说，十三月的艺人和音乐跟国...(展开全部)', 1539, '1540,1541,1542,1543,1544', '2018-12-28 06:38:44', NULL),
