(373, '戚玉武 Yuwu Qi', '男', '射手座', '1976-11-28 00:00:00', '中国,广东,广州', '演员', '715 (昵称) / Ah Wu (昵称)', '戚玉武是1999年《才华横溢出新秀》（新加坡最具权威的区域性演艺新人选拔赛)之《广东之星》的男冠军，也是同场比赛\"最有性格新秀\"一奖的得主。在踏入演艺圈以前，毕业自体育系的戚玉武是一名模特儿，曾获模特儿大赛冠军，也曾在广州主演过电视剧。　　在踏入演艺圈以前，戚玉武是广州体院的学生，因为身高和外形，被校友介绍去做兼职模特儿。经纪公司帮他报名参加“美在花城”。当时一心一意想做篮球运动员的他只是抱着去玩一下的心理参加了比赛，没想到一举夺魁，成为第六届...(展开全部)', 1563, '1564,1565,1566,1567,1568', '2018-12-28 06:38:49', NULL),
(374, '王戈 Ge Wang', '男', '狮子座', '1989-07-23 00:00:00', '广西', '演员', '', '王戈，1989年7月23日出生于广西，中国内地男演员，毕业于中国传媒大学表演系。　　2010年，参演话剧《最后只好停下来》，饰演爱迪生。2014年4月，参演话剧《咸蛋》；同年10月，参演话剧《东北往事》；同年12月，参演话剧《你好，疯子！》。2015年4月，参演话剧《蠢蛋》。2016年5月，与演员张一山等主演的警匪网剧《余罪》开播。　　2010年，参演了由中国传媒大学影视艺术学院导表系教授杨扬执导的话剧《最后只好停下来》，在其中饰演爱迪生一角。2012年，参演了由郑晓龙任艺...(展开全部)', 1570, '', '2018-12-28 06:39:09', NULL),
