(401, '丁嘉丽 Jiali Ding', '女', '射手座', '1959-12-16 00:00:00', '中国,黑龙江,佳木斯', '演员 / 配音', '', '丁嘉丽毕业于上海戏剧学院后，被分配到中国话剧院工作。1986年，参演首部电影《山林中的头一个女人》，凭借塑造的“大力神”形象夺得第7届中国电影金鸡奖最佳女配角奖。1991年，凭借电影《过年》荣获第十二届中国电影金鸡奖最佳女配角奖；1993年以《无人喝彩》荣获第十七届中国电影金鸡奖最佳女演员奖。1995年，与陈宝国、李亚鹏主演电视剧《北京深秋的故事》；1998年，在电视剧《骆驼祥子》里出演虎妞一角。1999年，凭借《红发卡》荣获第六届中国电影表演学会奖；同年，与孙红...(展开全部)', 1692, '1693,1694,1695,1696,1697', '2018-12-28 06:41:15', NULL),
(402, '徐峥 Zheng Xu', '男', '白羊座', '1972-04-18 00:00:00', '中国,上海', '演员 / 制片人 / 导演 / 编剧 / 配音', '', '徐峥，中国内地著名影视演员、话剧演员、导演。1994年毕业于上海戏剧学院毕业后，他顺利进入上海人艺（上海话剧艺术中心）担任演员。 1998年因出演《股票的颜色》获得第十届白玉兰戏剧奖最佳男主角奖。经过多部话剧的成功积累，他开始尝试出演电视剧，因为在《春光灿烂猪八戒》中塑造了憨厚可爱的猪八戒形象而被大家记住。之后因为在《李卫当官》中成功饰演一个凭借自身的流氓习气、正义感和大智慧的李卫，而成为了电视明星。 在荧屏上取得好成绩后，徐峥也积极向电影进军。因...(展开全部)', 1698, '1699,1700,1701,1702,1703', '2018-12-28 06:41:19', NULL),
