(447, '克莱尔·芙伊 Claire Foy', '女', '白羊座', '1984-04-16 00:00:00', '英国,英格兰,白金汉郡', '演员', '', '克莱尔·芙伊，英国演员，因出演BBC的小杜丽而备受关注。克莱尔·福伊出生在英格兰的Stockport，在曼彻斯特和利兹长大。她和家人不久就搬到了白金汉郡的Longwick。她有一半爱尔兰血统，是三个孩子中最小的。克莱尔·福伊曾经学习过芭蕾。在13岁时开始有尝试表演的想法，在学校中，她参与了几场表演，并一直对戏剧充满了热爱。她毕业于Aylesbury高中，此后她加入了Liverpool John Moores大学，一直学习戏剧和屏幕研究。她也在牛津戏剧学院学习过戏剧，并于2007年毕业。克莱尔·...(展开全部)', 1928, '1929,1930,1931,1932,1933', '2018-12-28 06:43:50', NULL),
