(502, '置鲇龙太郎 Ryôtarô Okiayu', '男', '天蝎座', '1969-11-17 00:00:00', '日本,福冈县,北九州市,小仓区', '配音 / 演员', 'Ryoutarou Okaiyu / Ryoutarou Okiayu / Ryutaro Okiayu / Ryuutarou Okiayu', '置鲇龙太郎，日本男性声优。青二Production所属。福冈县北九州市小仓南区出身、成长于大阪府大阪市。大阪市立南港光小学校、大阪市立南港北中学校、大阪府立阿倍野高等学校毕业。他发音时声音通常靠后，使声线有一种高傲的立体感，听时不禁让人联想到欧式城堡、举止优雅的贵族们和安逸午后的下午茶，再加上尾音部分时的气息处理，总能让人想起高贵的贵族青年，如《白色猎人》中的克洛弗德、《遥远时空中》中的亚克拉姆，《网球王子》中的手冢国光，以及日本著名动画《死神》中...(展开全部)', 2147, '2148,2149,2150,2151', '2018-12-28 06:45:31', NULL),
(503, '赵震雄 Cho Jin-woong', '男', '双鱼座', '1976-03-03 00:00:00', '韩国,釜山', '演员', '조진웅(本名) / Jin-woong Jo', '赵震雄，本名赵元俊。1976年3月3日出生于韩国。韩国演员。　　2001年，登上话剧舞台；　　2004年，客串出演动作爱情电影《马粥街残酷史》进入影视圈；　　2009年，参演了家庭情感剧《欲望的火花》；　　2010年，参演了悬疑电影《畅销书》，由此获得第18届春史电影节最佳新人男演员奖；　　2011年，因参演体育题材电影《棒球之爱》而获得第47届韩国百想艺术大赏电影类奖项-最佳新人男演员提名；　　2012年，主演了惊悚电影《嫌疑人X》，因此获得第49届韩国百想艺术大赏电...(展开全部)', 2153, '2154,2155,2156,2157,2158', '2018-12-28 06:46:09', NULL),
(504, '黄政民 Jeong-min Hwang', '男', '处女座', '1970-09-01 00:00:00', '韩国', '演员 / 编剧', '황정민(本名)', '韩国著名演员。1990年凭电影<将军儿子>出道，今天成为继崔敏植，韩石圭，宋康昊，薛景求，之后演技派明星。拥有着近来少见纤细感性派演技，饰演每个不同角色时都能带给观众不同新鲜感，是一个相当有张力演员。主要作品有电视剧《两个傻瓜》，电影《曾是超人的男人》、《幸福》等，音乐剧《不鲁德威42号》、《托米》等，多次获得最佳男演员奖，获得2008年最佳票房男演员奖　　高中重读时候通过了新人征选考试1990年参演当时风靡一时电影<将军儿子>出道15年后今天成为继崔敏植韩...(展开全部)', 2159, '2160,2161,2162,2164,2163', '2018-12-28 06:46:13', NULL),
(505, '朱智勋 Ji-hun Ju', '男', '金牛座', '1982-05-16 00:00:00', '韩国', '演员', 'Young-Hoon Ju (本名) / Handy Man (昵称)', '朱智勋，韩国男演员。1982年5月16日出生于韩国首尔，毕业于韩国京畿大学。　　2006年因出演电视剧《宫》中“李信”一角而走红 ，并凭此获2006年MBC演技大赏“最佳男新人奖”  。2007年出演人气剧集《魔王》再次受到人们关注。2008年1月18日，出席《2007亚洲模特颁奖礼》，获得“模特明星奖”。2008年11月，参演电影《西洋古董洋果子店》 ，并以此获得第45届韩国百想艺术大赏电影类“最佳人气奖” 。2010年，出演韩国国防部为纪念朝鲜战争60周年而特别制作的音乐剧《生命的航海...(展开全部)', 2165, '2166,2167,2168,2169,2170', '2018-12-28 06:46:23', NULL),
