(515, '利蒂希娅·赖特 Letitia Wright', '女', '天蝎座', '1993-10-31 00:00:00', '圭亚那,乔治敦', '演员', '', '利蒂希娅·赖特，英国女演员。2011年起在《上层男孩》《黑镜》《神秘博士》《追影逐凶》等诸多英国电视剧集中亮相。赖特曾入选英国影视艺术学院奖（BAFTA）2015年“最具突破精神英国人”（Breakthrough Brits）计划，该计划旨在支持最具潜力的新人。她现在最受瞩目的角色是在漫威系列影片《黑豹》《复仇者联盟3：无限战争》中饰演的Shuri一角。　　赖特出生于圭亚那乔治敦，七岁时随全家移民至英国伦敦。因为喜欢电影《阿基拉和拼字大赛》而对表演萌生兴趣，毛遂自荐多次后，...(展开全部)', 2203, '2204,2205,2206,2207,2208', '2018-12-28 06:47:44', NULL),
