(517, '凯伦·吉兰 Karen Gillan', '女', '射手座', '1987-11-28 00:00:00', '英国,苏格兰,因弗内斯', '演员 / 导演 / 编剧 / 配音', 'Karen Sheila Gillan(本名)', 'Karen Gillan出生于苏格兰因弗内斯，天生拥有一头漂亮的红发，充满青春朝气。在家身为独女的她七岁时学会了弹钢琴。年纪尚幼时，她就爱上了表演。她的第一次出镜是在《The Kevin Bishop Show》扮演多个角色，如Katy Perry和Angelina Jolie。2009年她被挑中出演《神秘博士》中新任博士女伴Amy Pond一角，她也曾在该剧第四季某集中扮演一个占卜者，是继弗莉玛·阿吉曼后第二位从小角色变成大角色的幸运女孩。Karen Gillan向世人证明打酱油也是能熬成主角的。　　豆瓣小站：http:...(展开全部)', 2215, '2216,2217,2218,2219,2220', '2018-12-28 06:47:47', NULL),
(518, '戴夫·巴蒂斯塔 Dave Bautista', '男', '摩羯座', '1969-01-18 00:00:00', '美国,华盛顿哥伦比亚特区', '演员 / 配音', 'Kahn (昵称) / Deacon Batista (昵称) / The Animal (昵称) / DJ (昵称) / David Michael Bautista Jr. (本名) / Dave Batista / Deacon Bautista (昵称)', 'Dave Bautista自从童年时期就因为脾气就被称为“the Animal”（野兽）。他在华盛顿长大，他描述那时的自己是“一个瘦弱的孩子有哮喘病还有一个大麻烦”，但是对挑战权威有着强烈的倾向。在父母离异后，他在San Francisco（旧金山）生活了一段时间，直到他的母亲把这个问题男孩送到他住在suburban Virginia（佛吉尼亚州的乡下）的父亲那里。17岁前，他一直和父母分开，一个人住，而且经常惹麻烦。 　　在接下来的十年中，Bautista每天训练并把自己锻炼为一个肌肉男，他的晚...(展开全部)', 2221, '2222,2223,2224,2225,2226', '2018-12-28 06:47:49', NULL),
