(525, '斯坦·李 Stan Lee', '男', '摩羯座', NULL, '美国,纽约', '编剧 / 制片人 / 演员 / 配音 / 导演', 'Stanley Martin Lieber (本名) / The Man (昵称)', '2008，两部美国大片——《钢铁侠》和《无敌浩克》在全世界刮起一股超级英雄狂潮，分别席卷全球票房达5.67亿美元和2.28亿美元。这两部大片的横空出世再次勾起了人们对漫画历史上那些超级英雄的记忆。蜘蛛侠、神奇四侠、X战警、夜魔侠……当然也包括钢铁侠和绿巨人，这一个个耳熟能详的名字都与一个人息息相关。他就是被尊为“漫画之王”、“蜘蛛侠之父”的斯坦·李。　　90岁的斯坦·李一手将惊奇漫画公司打造为全世界最为成功的动漫王国，神奇漫画总共创造了5000多个漫画角色...(展开全部)', 2257, '2258,2259,2260,2261,2262', '2018-12-28 06:47:54', NULL),
(526, '本尼西奥·德尔·托罗 Benicio del Toro', '男', '双鱼座', '1967-02-19 00:00:00', '波多黎各,桑图尔塞', '演员 / 制片人 / 配音 / 导演', 'Benicio Monserrate Rafael Del Toro Sanchez (本名) / Beno (昵称)', '本尼西奥·德尔·托罗无疑是好莱坞十分少见的那一类演员。1995年，他凭借着在影片《普通嫌疑犯》(The Usual Suspects)中扮演芬斯特一角而为影迷熟知。　　本尼西奥出生于波多黎各的桑图尔塞一个律师家庭。9岁时就失去了母亲；4年后，他父亲将全家搬至宾夕法尼亚州。后来，本尼西奥赴圣地亚哥的加利福尼亚大学攻读商业学位，期间他偶然参加了一次表演课，不料却迷上了表演。随后，他参加了一些学生创作表演，包括在一次戏剧节上参加纽约拉斐特戏剧院的指定演出。这以后他决定留...(展开全部)', 2263, '2264,2265,2266,2267,2268', '2018-12-28 06:47:55', NULL),
(527, '塞缪尔·杰克逊 Samuel L. Jackson', '男', '射手座', '1948-12-21 00:00:00', '美国,华盛顿,哥伦比亚特区', '演员 / 配音 / 制片人', 'Samuel Leroy Jackson (本名) / Mr Cool (昵称) / King of Cool (昵称) / Sam (昵称)', '塞缪尔·杰克逊1948年12月21日出生于美国华盛顿，在田纳西长大，从小就对课业非常的认真，并且进入位于亚特兰大的摩尔浩斯学院读建筑，后来才转到了戏剧系，以戏剧艺术学士的学位毕业。　　毕业后，塞缪尔·杰克逊搬到纽约，寻找演出的机会，在纽约的前10年之中，他过得并不好，想演电影却四处碰壁，只好先在小荧幕上演电视剧来糊口，或在影片中出任小得不能再小的角色赚取微薄的薪水，顺便等候任何能让他演电影的机会。1981年，他出演了《丛林热》中那位嗑药成瘾的流浪汉，为...(展开全部)', 2269, '2270,2271,2272,2273,2274', '2018-12-28 06:47:55', NULL),
