(529, '安东尼·麦凯 Anthony Mackie', '男', '天秤座', '1978-09-23 00:00:00', '美国,路易斯安那州,新奥尔良', '演员 / 编剧', '', '79年出生。02年开始演戏，他算是比较幸运的了，第一次就在《8英里 8 Mile 》里面演一个小角色，此后都是在大明星的电影里打酱油，比如《好莱坞重案组 Hollywood Homicide》、《满洲候选人 The Manchurian Candidate》、《百万美元宝贝 Million Dollar Baby》、等。04年就开始担任主演了，比如《兄弟情深 Brother To Brother》（提名独立精神奖最佳出道表演奖、哥谭奖提名）、《她恨我 She Hate Me 》（黑色卷轴奖提名）、《半个尼尔森 Half Nelson》、《恶棍自由之城 Sucker Fr...(展开全部)', 2281, '2282,2283,2284,2285,2286', '2018-12-28 06:47:55', NULL),
(530, '保罗·贝坦尼 Paul Bettany', '男', '双子座', '1971-05-27 00:00:00', '英国,哈勒斯登', '演员 / 配音 / 导演 / 编剧', '', '保罗·贝塔尼出生在一个表演世家，父亲和母亲都是演员，祖母和祖父也都是从事音乐或艺术行当，他走上演艺之路也成了理所当然的事情。虽然贝塔尼外型并不十分出众，但是却非常具有可塑性，可以适应各种各样类型的人物，在他饰演过的角色中，既有神经质的匪徒，也有文质彬彬的科学家，既有吊儿郎当的游吟诗人，也有严谨睿智的海军医生，都给观众留下了非常深刻的印象。　　1971年生于伦敦的贝塔尼，对这个大都市还未形成某些具体的概念，就随父母搬到偏僻的乡下居住，他对此次举...(展开全部)', 2287, '2288,2289,2290,2291,2292', '2018-12-28 06:47:55', NULL),
(531, '唐·钱德尔 Don Cheadle', '男', '射手座', '1964-11-29 00:00:00', '美国,密苏里州,堪萨斯城', '演员 / 制片人 / 导演 / 配音 / 编剧', 'Donald Frank Cheadle (本名)', '钱德尔，非洲裔美国演员。他在1993年至1995年播出的电视剧《Picket Fences》中扮演了一个热心的检察官。在电视屏幕建功立业的同时，还通过电影演出赢得声誉。1994年在《蓝衣魔鬼》中饰演丹尼泽·华盛顿的好友，为他赢得了洛杉矶影评人协会颁发的最佳男配角。1997年他联合主演了三部电影《活火熔城》，《热舞之夜》以及《黑色大风暴》，其中的后两部为他赢得了Image awards和SAG提名。1998年，在电视剧《The Rat Pack》中扮演山米-达维斯获得一项艾美奖提名和一项金球奖。钱德尔...(展开全部)', 2293, '2294,2295,2296,2297,2298', '2018-12-28 06:47:56', NULL),
(532, '范·迪塞尔 Vin Diesel', '男', '巨蟹座', '1967-07-18 00:00:00', '美国,纽约', '演员 / 制片人 / 配音 / 导演 / 编剧', 'Mark Sinclair Vincent(本名)', '范·迪塞尔，1967年7月18日出生于美国纽约。好莱坞知名影星，亦是好莱坞出名的演员加制片人。代表作品有《千面人》，《速度与激情》，《极限特工XXX》等。　　范·迪塞尔至今仍拒不向外界透露他的生活履历，甚至连真名都讳莫如深。他只向外界公开说自己的真姓是文森特，在纽约长大，父亲是一个戏院教师，而母亲是占星术士——在狗仔队成群的好莱坞，能够如此有效的保守秘密简直是一件奇迹。　　范·迪塞尔生就一张浅黑色、神秘兮兮的脸，外加一副低沉的嗓音，外型看上去像个...(展开全部)', 2299, '2300,2301,2302,2303,2304', '2018-12-28 06:47:58', NULL),
(533, '伊丽莎白·奥尔森 Elizabeth Olsen', '女', '水瓶座', '1989-02-16 00:00:00', '美国,加利福尼亚,谢尔曼奥克斯', '演员', 'Elizabeth Marie Olsen(本名) / Liz(昵称) / Lizzie(昵称)', '伊丽莎白·奥尔森，美国演员，因主演《双面玛莎》而备受关注的新生代女星。她是美国著名的电视明星姐妹奥尔森姐妹(Olsen Twins) 的小妹。作为极富传奇性的双胞胎童星“奥尔森姐妹”最小的妹妹，伊丽莎白·奥尔森从踏入演艺圈起就备受瞩目。作为奥尔森家族的全新势力，伊丽莎白在两位童星姐姐逐步淡出演艺圈后，成为奥尔森家族在好莱坞的全新代表。　　不同于两位姐姐在婴孩时期就开始大量参演电视剧，伊丽莎白的表演资历可谓是少得可怜，除了四岁时参演的电视剧以外，早期的伊...(展开全部)', 2305, '2306,2307,2308,2309,2310', '2018-12-28 06:48:00', NULL),
