(535, '布莱德利·库珀 Bradley Cooper', '男', '摩羯座', '1975-01-05 00:00:00', '美国,宾夕法尼亚,费城', '演员 / 制片人 / 导演 / 配音 / 编剧', '', 'Bradley Cooper在费城出生，却在Jenkintown长大，他的妈妈是一个意大利裔人，爸爸是个爱尔兰裔美国股票经纪人，所属于Merrill Lynch公司。1993年，Cooper从日耳曼学院毕业后就上了Villanova University，但是在大一的时候却突然转学到了Georgetown University，并顺利拿到英语学士学位。因为Cooper的法语相当流利，所以他又在大学毕业后置身前往法国呆了六个月，随后返乡修读戏剧、表演 专业并顺利在一家纽约演员工作室工作。　　Cooper的职业生涯开端应该从1998年的《欲望都...(展开全部)', 2317, '2318,2319,2320,2321,2322', '2018-12-28 06:48:00', NULL),
