(537, '汤姆·希德勒斯顿 Tom Hiddleston', '男', '水瓶座', '1981-02-09 00:00:00', '英国,伦敦,威斯敏斯特', '演员 / 配音 / 制片人', 'Thomas William Hiddleston (本名)', '汤姆·希德勒斯顿2008年和肯尼斯·布拉纳在Donmar剧院一起出演契科夫的《伊万诺夫》，后者邀请他去为《雷神》的主人公试镜——事实上几乎每一位身高过六英尺、能说英语的男演员都收到过这个邀请，但在进入最后一轮之后，希德勒斯顿开始当真了。他苦练了六个星期的肌肉并且卓有成效，但最终克里斯·海姆斯沃斯得到了这个角色。这时候，布拉纳语重心长地向他解释：有些人的有些东西是与生俱来的。杰克·尼克尔森扮演不恭不敬毫不费劲，而安东尼霍普金斯天生带有一股严肃和权威。I...(展开全部)', 2329, '2330,2332,2331,2333,2334', '2018-12-28 06:48:01', NULL),
(538, '斯嘉丽·约翰逊 Scarlett Johansson', '女', '射手座', '1984-11-22 00:00:00', '美国,纽约', '演员 / 配音 / 导演 / 其它', 'Scarlett I. Johansson (本名)', '生于1984年的斯嘉丽·约翰逊是当今好莱坞最具潜力的少女明星之一。　　斯嘉丽·约翰逊出生在纽约市，和她的弟弟是一对龙凤胎。她从8岁开始就从事专业表演，而她对演戏的兴趣，三岁时就显露了出来。长大后斯嘉丽进入了一家专门培养年轻演员的演艺学校学习，毕业后很快就登上小剧场舞台。她的舞台处女作的搭档是伊桑·霍克。　　1994年，斯嘉丽出演了她第一部影片——《North》。她在片中扮演了一个小角色，随后又演了两部名气不大的影片——《黑狱大平反》和《如果露西降临》...(展开全部)', 2335, '2336,2337,2338,2339,2340', '2018-12-28 06:48:02', NULL),
