(543, '小罗伯特·唐尼 Robert Downey Jr.', '男', '白羊座', '1965-04-04 00:00:00', '美国,纽约', '演员 / 制片人 / 编剧 / 配音', 'Robert John Ford - Elias Jr.(本名) / Bob(昵称)', '小罗伯特·唐尼，美国男演员。7岁时在父亲的电影《Greaser\'s Palace》中饰演角色，8岁时父亲递给了他人生第一支大麻烟，10岁时全家居住在伦敦，他参加了切尔西著名的Perry House School 学习古典芭蕾。从1976年起，他参加了三届Stagedoor Manor 表演夏令营，学习表演、舞蹈、声乐等，在其整个青少年时期，他和其家庭成员都在滥用大麻及可卡因。　　1977年，父母离异，他陪母亲住在纽约，而姐姐则和父亲住在加州。1981年， 前往洛杉矶和父亲团聚，在Santa Monica高中继续学业并...(展开全部)', 2359, '2360,2361,2362,2363,2364', '2018-12-28 06:48:06', NULL),
