(546, '克里斯·埃文斯 Chris Evans', '男', '双子座', '1981-06-13 00:00:00', '美国,马萨诸塞,波士顿', '演员 / 配音 / 导演', 'Christopher Robert Evans(本名) / Cevans(昵称)', '克里斯·埃文斯，生于美国马萨诸塞州波士顿，父亲是牙医，母亲是舞蹈演员。像许多明星一样，克里斯·埃文斯的演艺生涯始于学校剧和社区剧院，但他的迅速蹿红有些与众不同。　　1981年6月出生在波士顿的克里斯，11岁时随家人搬到萨德伯里郊区，就读于林肯-萨德伯里地区高中时，他的才华得到了戏剧老师的鼓励。有了学校剧和地区剧院表演经验的他，前往纽约就读于李·斯特拉斯伯格戏剧学院。在朋友的建议下，他在一家选角公司实习并与几位经纪人交上朋友，很快他开始参加影视剧的...(展开全部)', 2374, '2375,2376,2377,2378,2379', '2018-12-28 06:48:08', NULL),
(547, '塞巴斯蒂安·斯坦 Sebastian Stan', '男', '狮子座', '1982-08-13 00:00:00', '罗马尼亚,康斯坦察', '演员', 'Seb(昵称) / Sebs (昵称) / Baz (昵称)', '塞巴斯蒂安·斯坦生于罗马尼亚康斯坦察市。在他八岁的那年，由于他的母亲的工作关系（受聘为钢琴家），他与他的母亲搬至维也纳生活。在维也纳生活了四年后，十二岁的赛巴斯汀再次跟母亲移民到美国纽约州罗克兰县，而他的母亲和当地的一位私立学校的校长结婚。　　在他正就读罗克兰县日间学校的同时，他参与演出了数个话剧和舞台剧，例如有《哈维》（Harvey），《风流剑客》（Cyrano de Bergerac）、《异形奇花》（Little Shop of Horrors）、《Over Here》和《西区故事》（Wes...(展开全部)', 2380, '2381,2382,2383,2384,2385', '2018-12-28 06:48:09', NULL),
