(549, '马克·鲁弗洛 Mark Ruffalo', '男', '天蝎座', '1967-11-22 00:00:00', '美国,威斯康星州,基诺沙', '演员 / 导演 / 制片人 / 编剧', 'Mark Alan Ruffalo (本名)', '马克·鲁弗洛是美国威斯康辛州人，幼年时与其家人移居至弗吉尼亚，在那儿他度过了少年岁月。高中后，马克·鲁弗洛又与他的家人搬到圣迭戈，接着又搬到北部，最后定居在洛杉矶。　　他在斯特拉阿德勒音乐学院学习，随后和人共同创办了“厄狄朗普斯”剧团，开始从事话剧表演。他在各方面努力实践以提升自己的知名度，他干过演员、编剧、导演和制片。尽管如此，他仍然得不到在电影和电视上露脸的机会，以致于当了差不多九年的酒吧招待来维持生计。正当他打算放弃演艺事业时，话剧...(展开全部)', 2389, '2390,2391,2392,2393,2394', '2018-12-28 06:48:12', NULL),
