(614, '乌玛·瑟曼 Uma Thurman', '女', '金牛座', '1970-04-29 00:00:00', '美国,马萨诸塞,波士顿', '演员 / 编剧 / 制片人 / 配音', 'Uma Karuna Thurman (本名)', '著名的好莱坞女星乌玛·瑟曼天生丽质，身高178厘米，身材纤细，一向是不少影迷心目中的标准美女，乌玛·瑟曼1970年4月29日出生在美国波士顿，父亲是研究印度佛教哲学的专家，母亲来自瑞典，是个心理分析医生。东方文化的熏陶和一袭欧洲风韵，使美丽的乌玛瑟曼气质独特，且有种神秘感。乌玛·瑟曼有一种其他女演员无法匹敌的致命性感魅力。她的表演力戒张扬，在平淡中表现人性深度。　　乌玛的童年极不快乐，由于来自信奉佛教的家庭，在全部信仰基督的美国小镇上她倍受歧视，被...(展开全部)', 2629, '2630,2631,2632,2633,2634', '2018-12-28 06:50:30', NULL),
