(649, '齐欢 Huan Qi', '女', '白羊座', '1979-04-12 00:00:00', '山东淄博', '演员', '', '内地女演员齐襄因《与青春有关的日子》一剧人气直线上升，她对剧中李白玲一角的演绎，得到了观众和业内人士的认可，近来戏约不断。其实齐襄首次崭露头角，获得大家观注的还是因为电影《美人草》里卫红一角，她凭借这个角色先后获得了第24届电影金鸡奖最佳女配角奖提名和第5届华语传媒大奖最佳女配角提名。　　而后齐襄出演了《千钧一发》、《女人的选择》，一个是温柔体贴的市长千金，一个是个性自我的都市女孩，这两个角色都被齐襄诠释得生动鲜活，深入人心。她用自己对人物...(展开全部)', 2780, '2781,2782,2783,2784,2785', '2018-12-28 06:52:36', NULL),
