(652, '吕乐 Yue Lu', '男', '射手座', '1957-12-01 00:00:00', '中国,天津', '摄影 / 导演 / 编剧 / 演员', 'Yue Lü', '吕乐（1957年12月26日－）生于天津，1982年毕业于北京电影学院摄影系，曾留学法国学习视觉艺术，是中国第五代摄影师、导演，曾获得多项摄影和导演奖项。80年代中期他与同学合作拍摄了《猎场扎撒》和《净土》。由于英文和专业出色，应邀参与伊文思（Joris Ivens）电影《风》的选景工作。1987年他执导拍摄纪录片《怒江，一条丢失的峡谷》，该片荣膺1990年度巴黎“人类学电影”大奖。这一契机使他与法国结缘，开始了五年的（1987-1992年）游学生涯，之后获巴黎第八大学造型系硕士...(展开全部)', 2798, '2799,2800', '2018-12-28 06:52:49', NULL),
