(666, '阿方索·卡隆 Alfonso Cuarón', '男', '射手座', '1961-11-28 00:00:00', '墨西哥,墨西哥城联邦区', '制片人 / 导演 / 编剧 / 剪辑 / 副导演', 'Alfonso Cuarón Orozco (本名) / Alfie (昵称)', '阿方索·卡隆于1961年11月28日出生在墨西哥城，从小就想成为导演和宇航员，不过因为不想参军而放弃了宇航员的梦想。幼小的他不喜欢玩耍，而一直希望能拍摄电影，12岁生日时，卡隆终于得到了一部照相机，从此开始拍摄见到的一切，并将作品向每个人展示。电影是他少年时期的酷爱，看的电影不少，朋友却没几个。有时他对母亲说去朋友家，而实际是去了电影院。他想看遍城里所有的电影院，甚至离家不远的两家摄影棚也不放过。　　中学毕业之后，卡隆希望进入CCC(Centro de Capacita...(展开全部)', 2836, '2837,2838,2839,2840,2841', '2018-12-28 06:53:41', NULL),
