(674, '伊万杰琳·莉莉 Evangeline Lilly', '女', '狮子座', '1979-08-03 00:00:00', '加拿大,阿尔伯塔省,萨斯喀彻温堡', '演员', 'Nicole Evangeline Lilly (本名) / Monkey (昵称) / Evie (昵称)', '1979年出生在加拿大阿尔伯塔省(Alberta)的Fort Saskatchewan，父母的职业分别是教师和化妆师，家里还有一个姐姐和一个妹妹。伊万杰琳从小就是热情好动的外向孩子，并且一直有将来成为演员的想法，此外她可以流利地说法语。大学时节她来到了英属哥伦比亚省的基隆拿市，主修国际关系学，在这个小镇的街道上伊万杰琳曾被一位来自著名的福特模特经济公司的星探发掘，但当时她拒绝了对方的提议，直到发现空姐、女招待等工作难以支付起大学学费时才重新考虑，最终进入了模特这一行业...(展开全部)', 2860, '2861,2862,2863,2864,2865', '2018-12-28 06:54:00', NULL),
(675, '保罗·路德 Paul Rudd', '男', '白羊座', '1969-04-06 00:00:00', '美国,新泽西州,帕塞伊克', '演员 / 配音 / 编剧 / 制片人', 'Paul Stephen Rudd (本名) / Fred (昵称)', '1969年，保罗·路德出生在美国的新泽西，他的父母是来自英国的俄裔犹太人，身上还有波兰血统。他有一个小三岁的妹妹，由于父亲航空相关的工作（后成为一名历史导游）一家人常常搬家，最终定居在堪萨斯州的堪萨斯城。高中毕业之后保罗进入堪萨斯大学主修戏剧，在念到大二时被位于洛山矶的The American Academy of Dramatic Arts录取，在那里他得到了制片人Michael Kahn的指导。 1992年，他在处女作《Sisters》中扮演阿什丽·贾德的男友登台，1995年出演的爱情喜剧《独领风骚》出...(展开全部)', 2866, '2867,2868,2869,2870,2871', '2018-12-28 06:54:01', NULL),
