(684, '米歇尔·菲佛 Michelle Pfeiffer', '女', '金牛座', '1958-04-29 00:00:00', '美国,加利福尼亚,圣安娜', '演员 / 配音 / 制片人', 'Michelle Marie Pfeiffer (本名)', '1958年4月29日，米歇尔·菲佛出生于加州的圣芭芭拉，在她驾车至好莱坞之前，菲佛曾在当地的超市当过收银小姐同时也当选过橘郡小姐。菲佛的演艺生涯起于小荧幕，她演过影集《梦幻岛》，也同时接拍电视广告等等来补充收入，不过即使早年的菲佛跃上了大荧幕，也一样会被当成性感小猫在镜头前摆来摆去，并非如今日般会受到双面肯定。 1988年及1989年菲佛分别以《危险关系》及《一曲相思情未了》获得奥斯卡最佳女配角及女主角奖提名。1993年以《枪声响起》登上柏林影展后座。同年与...(展开全部)', 2892, '2893,2894,2895,2896,2897', '2018-12-28 06:54:06', NULL),
