(689, '迈克尔·道格拉斯 Michael Douglas', '男', '天秤座', '1944-09-25 00:00:00', '美国,新泽西,新不伦瑞克', '演员 / 制片人 / 导演 / 编剧', 'Michael Kirk Douglas (本名)', '麦克-道格拉斯的父亲是鼎鼎大名的库克-道格拉斯。父亲在好莱坞的赫赫威名对年轻的麦克来说不啻是一个很沉重的包袱。不过，虽然生长在父亲巨大的身影下，但麦克还是很努力地闯出了属于自己的一片天地。他甚至不惜拒演类似父亲形象的勇者角色，以塑造自己的银幕形象。　　从1969年推出第一部电影后，麦克在好莱坞的霸主地位可以说是纵横影坛数十年而不倒。1975年影片《飞越疯人院》(One Flew Over the Cuckoo\'s Nest)更是让他出尽风头。这部描写精神病院的影片不仅为他...(展开全部)', 2907, '2908,2909,2910,2911,2912', '2018-12-28 06:54:09', NULL),
