(695, '迈克尔·佩纳 Michael Peña', '男', '摩羯座', '1976-01-13 00:00:00', '美国,伊利诺伊州,芝加哥', '演员 / 配音', 'Michael A. Pena / Michael Anthony Pena / Michael A. Peña / Michael Anthony Peña', '迈克·安东尼·佩纳，美国演员，音乐家。他出演过多部影片，包括《撞车》（2004年）、《通天塔》（2006年）、《生死狙击》（2007年）等、《洛杉矶之战》（2011年）、《林肯律师》（2011年）。近期的作品包括《美国骗局》、《蚁人》、《火星救援》。　　佩纳出生于伊利诺伊州芝加哥市。父亲是社工，母亲是工厂工人。佩纳的父母亲原先都是来自墨西哥的农民。佩纳和妻子Brie Shaffer于2006年结婚。他还是山达基教徒。　　佩纳自1994年从影至今，一直到2004年，在奥斯卡最佳影片...(展开全部)', 2923, '2924,2925,2926,2927,2928', '2018-12-28 06:54:12', NULL),
