(698, '斯坦·李 Stan Lee', '男', '摩羯座', NULL, '美国,纽约', '编剧 / 制片人 / 演员 / 配音 / 导演', 'Stanley Martin Lieber (本名) / The Man (昵称)', '2008，两部美国大片——《钢铁侠》和《无敌浩克》在全世界刮起一股超级英雄狂潮，分别席卷全球票房达5.67亿美元和2.28亿美元。这两部大片的横空出世再次勾起了人们对漫画历史上那些超级英雄的记忆。蜘蛛侠、神奇四侠、X战警、夜魔侠……当然也包括钢铁侠和绿巨人，这一个个耳熟能详的名字都与一个人息息相关。他就是被尊为“漫画之王”、“蜘蛛侠之父”的斯坦·李。　　90岁的斯坦·李一手将惊奇漫画公司打造为全世界最为成功的动漫王国，神奇漫画总共创造了5000多个漫画角色...(展开全部)', 2931, '2932,2933,2934,2935,2936', '2018-12-28 06:54:14', NULL),
