(715, '米歇尔·莫纳汉 Michelle Monaghan', '女', '白羊座', '1976-03-23 00:00:00', '美国,爱荷华,温思罗普', '演员 / 配音', 'Michelle Lynn Monaghan (本名)', '1976年出生在美国中西部爱荷华州布勘纳县人口不足一千的小镇温思罗普，她的父亲是一位工厂工人和半个农民，母亲则在家里开设了一家幼儿园，米歇尔还有两位哥哥。高中毕业后她进入芝加哥哥伦比亚学院主修新闻，另一部分事件兼职做起了模特，米歇尔·莫娜汉曾在米兰以及亚洲的新加坡、东京和香港等地走秀，与此同时她也逐渐对表演产生了兴趣。　　2000与2001年她分别客串了电视剧《年轻的美国人》和《法律与秩序：特别受害者》，并和多位模特一起出演了影片《Perfume》，并在《...(展开全部)', 2989, '2990,2991,2992,2993,2994', '2018-12-28 06:54:44', NULL),
