(720, '亚历克·鲍德温 Alec Baldwin', '男', '白羊座', '1958-04-03 00:00:00', '美国,纽约,长岛,马萨佩奎', '演员 / 配音 / 制片人 / 编剧 / 导演', 'Alexander Rae Baldwin III (本名)', '亚历克·鲍德温，美国著名影视演员，曾在纽约大学攻读戏剧，毕业后日间出演电视肥皂剧，晚间加盟莎翁舞台剧表演。80年代初开始活跃在电视荧屏上，参加了《医生》（The Doctors）和《Knots Landing》等电视系列剧的拍摄。此后，亚历克-鲍德温正式步入影坛，先后在《永远的璐璐》（Forever,Lulu）、《甲壳虫汁》（Beetle Juice）、《乌龙密探摆黑帮》（Married to the Mob）和《抓狂电台》（Talk Radio）等多部影片中出演一些比较严肃的角色。1990年，亚历克-鲍德温第一次出现在...(展开全部)', 3012, '3013,3014,3015,3016,3017', '2018-12-28 06:54:53', NULL),
(721, '亨利·卡维尔 Henry Cavill', '男', '金牛座', '1983-05-05 00:00:00', '英国,泽西岛', '演员', 'Henry William Dalgliesh Cavill (本名) / Henners (昵称) / Henners, Hank (昵称)', '亨利·卡维尔1983年出生在位于英吉利海峡南端的泽西岛，家中有四位兄弟，读寄宿学校时成为学校剧团的男主角。　　2001年他在自己的首部影片《新基督山伯爵》中出色地演绎了默塞德斯之子Albert Mondego的角色，年纪轻轻便让人注意到了他在表演方面的资质和潜力，此外还拥有着一副高大、俊朗和清澈的英国绅士外表，然而正是这样的他却又被05年12月版的帝国杂志描述为“好莱坞最不幸的人”，原因则在于那些他错过了的著名角色。　　卡维尔先是在最后阶段将《蝙蝠侠：开战时刻》...(展开全部)', 3018, '3019,3020,3021,3022,3023', '2018-12-28 06:54:53', NULL),
(722, '汤姆·克鲁斯 Tom Cruise', '男', '巨蟹座', '1962-07-03 00:00:00', '美国,纽约,雪城', '演员 / 制片人 / 导演 / 配音 / 编剧', 'Thomas Cruise Mapother IV (本名)', '美国著名影星，成功地从饰演高中生偶像转型至饰演成人角色，成为名利双收的超级影星，而创造超10亿美元的票房成绩。多次荣获奥斯卡奖项。　　克鲁斯不同于许多演员和明星，他并没有天赋的演技，他的成功全靠自己不断地学习与苦练，克服自身的弱点，补充有益的经验。早年的吃苦精神对他帮助极大，终于，他凭着自己坚韧不拔、吃苦钻研的精神一步步走向成功与辉煌。 克鲁斯的第一部影片是《熄灯号》(《Taps》1982)，这是一部反映军营生活的喜剧片，克鲁斯从此走上泪与汗交织的奋...(展开全部)', 3024, '3025,3026,3027,3028,3029', '2018-12-28 06:54:53', NULL),
