(782, '许晴 Qing Xu', '女', '水瓶座', '1969-01-22 00:00:00', '中国,北京', '演员 / 配音 / 导演', 'Summer', '许晴，1969年1月22日生于北京。1988年面临国际关系学院与北京电影学院的两张录取通知书时，许晴毫不犹豫地选择了后者，成为电影学院88级表演系本科学生。　　最早踏上银幕的是与陈凯歌导演合作的影片《边走边唱》，之后又在凌子风导演的《狂》中担任主演，成绩不错，陆续引人注目。许晴为大多数人所知是在电视连续剧《皇城根儿》向全国播放的时候，她清纯、奔放的形象立即成为年轻人的偶像。　　1992年应新加坡广播局的邀请，她被广电部公派赴新，成为中新文化交流活动中电影...(展开全部)', 3262, '3263,3264,3265,3266,3267', '2018-12-28 06:57:10', NULL),
