(785, '泽田谦也 Kenya Sawada', '男', '水瓶座', '1965-01-28 00:00:00', '日本,神奈川县', '演员', 'Kenya', '血型：O型　　身高：173CM　　胸围：110CM　　国籍：日本　　出身日期：1965年6月28日　　在上个世纪80－90年代，到香港来发展的日本演员很多，但余姚是动作片方面的，如大岛由加利、仓田保昭......　　泽田谦也算是一个以拍动作片为主的演员，在《霹雳火》中与成龙打斗那段可以看出，在《鬼子来了》居然看到了硕大的胸肌....　　参演主要作品：　　1. 新宿事件 Shinjuku Incident (2009) .....Nakajima　　日文： 新宿インシデント　　2. 野郎 Color of Pain (2002)...(展开全部)', 3275, '3276', '2018-12-28 06:57:12', NULL),
(786, '丁嘉丽 Jiali Ding', '女', '射手座', '1959-12-16 00:00:00', '中国,黑龙江,佳木斯', '演员 / 配音', '', '丁嘉丽毕业于上海戏剧学院后，被分配到中国话剧院工作。1986年，参演首部电影《山林中的头一个女人》，凭借塑造的“大力神”形象夺得第7届中国电影金鸡奖最佳女配角奖。1991年，凭借电影《过年》荣获第十二届中国电影金鸡奖最佳女配角奖；1993年以《无人喝彩》荣获第十七届中国电影金鸡奖最佳女演员奖。1995年，与陈宝国、李亚鹏主演电视剧《北京深秋的故事》；1998年，在电视剧《骆驼祥子》里出演虎妞一角。1999年，凭借《红发卡》荣获第六届中国电影表演学会奖；同年，与孙红...(展开全部)', 3277, '3278,3279,3280,3281,3282', '2018-12-28 06:57:13', NULL),
(787, '彭于晏 Eddie Peng', '男', '白羊座', '1982-03-24 00:00:00', '台湾,澎湖', '演员', 'Yu-yan Peng / Yuyen Peng / Eddie', '彭于晏，台湾演员。13岁和家人移民到加拿大，进入加拿大英属哥伦比亚大学，主修经济学。原以为自己会走上从商之路，然而，升大二暑假外婆过世，他回台奔丧，遇到小时候拍广告认识的导演杨大庆，找他演出偶像剧《爱情白皮书》。彭于晏回忆说：“我抱持打工的心情去尝试，当时也没签任何合约就去拍戏。”因而进入演艺圈而休学专心拍片。　　入行以来，获得过多次大奖，2006年凭借作品《我只在乎你》入围台湾第41届电视金钟奖戏剧节目最佳男配角奖；2007年凭借影片《基因决定我爱...(展开全部)', 3283, '3284,3285,3286,3287,3288', '2018-12-28 06:57:14', NULL),
(788, '约翰尼·德普 Johnny Depp', '男', '双子座', '1963-06-09 00:00:00', '美国,肯塔基,欧文斯伯勒', '演员 / 配音 / 制片人 / 导演 / 编剧', 'John Christopher Depp II (本名) / Colonel (昵称) / Mr. Stench (昵称)', '约翰尼·德普，1963年6月出生于美国肯塔基州的一个中产家庭，在佛罗里达州长大。15岁时他的父母离异，这让他一度成为不良少年并染上毒瘾。在舅父的唱诗班他迷恋上了音乐，还曾经自组摇滚乐队。在1983年，为了成为摇滚歌手，他前往洛杉矶发展。同年，他与他的第一任妻子，化妆师Lori Anne Allison结婚，并通过她认识了尼古拉斯·凯奇。正是在凯奇的大力引荐下，约翰尼·德普开始踏入影视圈，走上星路。　　小时候他不喜欢念书，经常一个人关在房间里苦练吉他，高中辍学后，他前...(展开全部)', 3290, '3291,3292,3293,3294,3295', '2018-12-28 06:57:22', NULL),
