(808, '杰米·坎贝尔·鲍尔 Jamie Campbell Bower', '男', '天蝎座', '1988-11-22 00:00:00', '英国,伦敦', '演员 / 配音 / 编剧', 'James Campbell M Bower (本名)', '英国演员。以蒂姆·伯顿导演的电影《理发师陶德：舰队街的恶魔理发师》中Anthony Hope(安东尼)最为人所知。他曾在《暮光之城：新月》中饰演Caius，以及在《卡默洛特(Camelot)》饰演的亚瑟王，表现出众。杰米也在《哈利波特与死亡圣器》上下两部中饰演盖勒特·格林德沃（Gellert Grindelwald）。杰米还将出演改编自电影的《The Mortal Instruments》(电视剧)中的Jace Wayland。　　鲍尔出生在伦敦詹姆斯坎伯M.鲍尔 。他的母亲，Anne Elizabeth安妮·伊丽莎白（娘家姓Roseberry...(展开全部)', 3356, '3357,3358,3359,3360,3361', '2018-12-28 06:57:33', NULL),
