(835, '徐峥 Zheng Xu', '男', '白羊座', '1972-04-18 00:00:00', '中国,上海', '演员 / 制片人 / 导演 / 编剧 / 配音', '', '徐峥，中国内地著名影视演员、话剧演员、导演。1994年毕业于上海戏剧学院毕业后，他顺利进入上海人艺（上海话剧艺术中心）担任演员。 1998年因出演《股票的颜色》获得第十届白玉兰戏剧奖最佳男主角奖。经过多部话剧的成功积累，他开始尝试出演电视剧，因为在《春光灿烂猪八戒》中塑造了憨厚可爱的猪八戒形象而被大家记住。之后因为在《李卫当官》中成功饰演一个凭借自身的流氓习气、正义感和大智慧的李卫，而成为了电视明星。 在荧屏上取得好成绩后，徐峥也积极向电影进军。因...(展开全部)', 3468, '3469,3470,3471,3472,3473', '2018-12-28 06:58:01', NULL),
(836, '宁浩 Hao Ning', '男', '处女座', '1977-09-09 00:00:00', '中国,山西,太原', '演员 / 导演 / 编剧 / 制片人 / 剪辑', '', '宁浩，中国电影导演、编剧。曾做过自行车装配工，音乐人，舞台美术设计，广告设计，平面摄影师，摄像师。后就职太原话剧团，其后考入北京师范大学艺术系，学习导演。2003年6月毕业于北京电影学院图片摄影专业。　　宁浩的学生电影《星期四，星期三》(2001)获得了当年北京大学生电影节最佳导演奖和中国大学生电影数码媒体竞赛银奖。宁浩的首部电影处女作《香火》(2003)在瑞士罗卡洛举行了首映，并获得东京银座电影节大奖，之后又获得香港国际电影节亚洲DV竞赛单元金奖。该电影...(展开全部)', 3474, '3475,3476,3477,3478,3479', '2018-12-28 06:58:03', NULL),
