(839, '龚蓓苾 Beibi Gong', '女', '双鱼座', '1978-02-21 00:00:00', '中国,福建,石狮', '演员 / 配音 / 制片人', '', '龚蓓苾，中国电影女演员。她出身童星，后就读中央戏剧学院，期间在大陆和香港出演了一些流行电视剧和专题片并在中国的少儿观众中获得好评。因她在学生时代即取得成功，被媒体称为“小巩俐”。　　毕业后，她继续扮演各种角色，包括在威尼斯电影节、圣丹斯电影节和戛纳电影节中首映并获奖的《车四十四》，她在剧中的表演使她得到来自中国、欧洲、北美的热烈称赞。　　2005年，龚蓓苾参演电影《独自等待》，该片在东京电影节中获得好评。同年9月这部独立完成的电影在全国上映，...(展开全部)', 3491, '3492,3493,3494,3496,3495', '2018-12-28 06:58:13', NULL),
