(855, '张艺谋 Yimou Zhang', '男', '白羊座', '1950-04-02 00:00:00', '中国,陕西,西安', '导演 / 演员 / 制片人 / 编剧 / 摄影', 'Zhang Yimou / Lao MouZi', '张艺谋，电影导演，北京奥运会开幕式总导演，他以执导充满浓浓中国乡土情味的电影著称，艺术特点是细节的逼真和主题的浪漫互相映照，是中国大陆“第五代导演” 的代表人物之一 。2010年5月24日获颁美国耶鲁大学荣誉博士学位。　　在中国，张艺谋似乎是电影界的一个神话，他从来不拍电视剧，只拍电影；而他的电影、不论是城市题材还是农村题材，不论是现代还是当代，总是令人刮目相看。在张艺谋看来，“城市题材和农村题材不能构成一个话题，现在好的题材不多，我只是找有感觉...(展开全部)', 3565, '3566,3567,3568,3569,3570', '2018-12-28 06:59:06', NULL),
(856, '吴磊 Leo Wu', '男', '摩羯座', '1999-12-26 00:00:00', '中国,上海', '演员 / 配音', 'Lei Wu', '性格活泼外向，爽朗大方，家境还算优渥，是家中的开心果。　　一次在上海太平洋百货的偶遇，一只广告公司邀约，就此改变了他的命运。　　当时3岁的吴磊获邀接演了第一个广告《黄金搭档》，由于表现出色，形象效果俱佳，　　很快便受到多家广告公司的青睐，在短短两年内,吴磊接连演出多达50余部广告，从而启发吴磊优秀的表演天份。　　吴磊5岁时在电视剧《封神榜之凤鸣岐山》“小哪吒” 角色公开海选中，经过漫长的评比过程，在数百个试镜小演员当中脱颖而出。　　值得一提...(展开全部)', 3571, '3572,3573,3574,3575,3576', '2018-12-28 06:59:11', NULL),
