(866, '李勤勤 Qinqin Li', '女', '金牛座', '1963-05-02 00:00:00', '中国,北京', '演员', '', '李勤勤，出生于北京。1984年开始演戏，第一部当主演的是在中美合拍的影片《北京故事》中，之后，在电影《净土》、《川岛芳子》、《银蛇谋杀案》中都有她的角色。 代表作品《川岛芳子》《卡拉是条狗》、《京华烟云》。最新作品《当婆婆遇上妈》口碑不错。　　1984年开始演戏，第一部当主演的是在中美合拍的影片《北京故事》中，之后，在电影《净土》、《川岛芳子》、《银蛇谋杀案》中都有她的角色。　　1986年初，随着出国热的兴起，她被外面世界精彩欲望驱使着，东渡日本，一...(展开全部)', 3631, '3632,3633,3634,3635,3636', '2018-12-28 06:59:50', NULL),
