(869, '张磊 Lei Zhang', '男', '射手座', NULL, '', '', '', '电影　　2009《寻找微尘》饰杜磊 （影片获“五个一”工程奖）　　导演：沈东 合作演员：黄渤黄晓明黑妹李婷　　2009《倔强萝卜》饰大壮　　导演：田蒙 合作演员：黄渤黄奕杜海涛马书良　　2010《戒烟不戒酒》饰辛总　　导演：朱时茂 合作演员：朱时茂梁天刘惠乔任梁赵英俊莫小奇王迅　　2011年电影《回家》饰演黄毛　　导演：李聃 合作演员：麻维江许海磊　　2011快乐女生青春态度微电影 《在一起》合作演员：付梦妮 武艺　　《果20的48小时》合作演员：王艺洁 张亮...(展开全部)', 3649, '3650,3651,3652,3653,3654', '2018-12-28 06:59:56', NULL),
