(872, '梁静 Jing Liang', '女', '巨蟹座', '1972-07-17 00:00:00', '中国,福建,福州', '演员 / 主持人 / 导演 / 制片人 / 编剧', 'Ching Leung', '', 3658, '3659,3660,3661,3662,3663', '2018-12-28 07:00:06', NULL),
(873, '黄渤 Bo Huang', '男', '处女座', '1974-08-26 00:00:00', '中国,山东,青岛', '演员 / 配音 / 导演 / 编剧 / 制片人', '', '黄渤不但具有专业的表演素质，在他身上更散发着来自内心的真实与质朴。他曾经做过歌手、节目主持人和舞蹈编导，后来又经过了专业的配音学习，这些丰富的人生经历，使他更具备了优于其他演艺新人的专业素质。　　黄渤毕业于北京电影学院配音专业。在就读电影学院之前就参加过管虎导演的作品演出，包括大家熟悉的电视电影《上车，走吧》、电视剧《黑洞》。其中《上车，走吧》不但获得了该年度的金鸡奖最佳电视电影奖，黄渤更凭片中的出色演出，受到了业内人士及广大观众对其演技...(展开全部)', 3664, '3665,3666,3667,3668,3669', '2018-12-28 07:00:07', NULL),
(874, '徐峥 Zheng Xu', '男', '白羊座', '1972-04-18 00:00:00', '中国,上海', '演员 / 制片人 / 导演 / 编剧 / 配音', '', '徐峥，中国内地著名影视演员、话剧演员、导演。1994年毕业于上海戏剧学院毕业后，他顺利进入上海人艺（上海话剧艺术中心）担任演员。 1998年因出演《股票的颜色》获得第十届白玉兰戏剧奖最佳男主角奖。经过多部话剧的成功积累，他开始尝试出演电视剧，因为在《春光灿烂猪八戒》中塑造了憨厚可爱的猪八戒形象而被大家记住。之后因为在《李卫当官》中成功饰演一个凭借自身的流氓习气、正义感和大智慧的李卫，而成为了电视明星。 在荧屏上取得好成绩后，徐峥也积极向电影进军。因...(展开全部)', 3670, '3671,3672,3673,3674,3675', '2018-12-28 07:00:10', NULL),
(875, '张艺兴 Yixing Zhang', '男', '天秤座', '1991-10-07 00:00:00', '中国,湖南,长沙', '演员', 'LAY / Issing Zhang / Jang Ye Heung / 장이씽', '', 3676, '3677,3678,3679,3680,3681', '2018-12-28 07:00:11', NULL),
(876, '黄渤 Bo Huang', '男', '处女座', '1974-08-26 00:00:00', '中国,山东,青岛', '演员 / 配音 / 导演 / 编剧 / 制片人', '', '黄渤不但具有专业的表演素质，在他身上更散发着来自内心的真实与质朴。他曾经做过歌手、节目主持人和舞蹈编导，后来又经过了专业的配音学习，这些丰富的人生经历，使他更具备了优于其他演艺新人的专业素质。　　黄渤毕业于北京电影学院配音专业。在就读电影学院之前就参加过管虎导演的作品演出，包括大家熟悉的电视电影《上车，走吧》、电视剧《黑洞》。其中《上车，走吧》不但获得了该年度的金鸡奖最佳电视电影奖，黄渤更凭片中的出色演出，受到了业内人士及广大观众对其演技...(展开全部)', 3682, '3683,3684,3685,3686,3687', '2018-12-28 07:00:14', NULL),
(877, '宁浩 Hao Ning', '男', '处女座', '1977-09-09 00:00:00', '中国,山西,太原', '演员 / 导演 / 编剧 / 制片人 / 剪辑', '', '宁浩，中国电影导演、编剧。曾做过自行车装配工，音乐人，舞台美术设计，广告设计，平面摄影师，摄像师。后就职太原话剧团，其后考入北京师范大学艺术系，学习导演。2003年6月毕业于北京电影学院图片摄影专业。　　宁浩的学生电影《星期四，星期三》(2001)获得了当年北京大学生电影节最佳导演奖和中国大学生电影数码媒体竞赛银奖。宁浩的首部电影处女作《香火》(2003)在瑞士罗卡洛举行了首映，并获得东京银座电影节大奖，之后又获得香港国际电影节亚洲DV竞赛单元金奖。该电影...(展开全部)', 3688, '3689,3690,3691,3692,3693', '2018-12-28 07:00:14', NULL),
(878, '王宝强 Baoqiang Wang', '男', '双子座', '1984-05-29 00:00:00', '中国,河北,邢台', '演员 / 配音 / 导演', '', '王宝强，中国男演员。王宝强6岁时开始练习武术，8岁-14岁在河南嵩山少林寺做俗家弟子，之后来到北京闯天下，在各个剧组当武行做群众演员。命运似乎很眷顾这个看上去普普通通的孩子，16岁时，王宝强被导演李扬挑中，主演独立电影《盲井》，这部电影让他一夜之间从武行变成金马奖最佳新人。此外，王宝强还凭《盲井》获得了法国第五届杜威尔电影节“最佳男主演奖”以及第二届曼谷国际电影节“最佳男演员奖”。　　2004年，参演冯小刚贺岁剧《天下无贼》，名声大噪，其朴实的个性...(展开全部)', 3694, '3695,3696,3697,3698,3699', '2018-12-28 07:00:16', NULL),
(879, '舒淇 Qi Shu', '女', '白羊座', '1976-04-16 00:00:00', '台湾,新北', '演员 / 配音 / 编剧', 'Hsu Chi / Shu Kei', '舒淇1976年4月16日出生，台湾人。原名林立慧。由于家境贫寒，从高中起就不再读书，为了赚钱养家她。当上了业余模特，也因为养成的独立个性，至今仍没有改变。　　舒淇透露童年时期一段不堪回首的过去：她小的时候家里很穷，全家人从来没有吃过一顿稍微奢侈一点的大餐，父母也不准她有零花钱，更不用说自己买东西。在舒淇的记忆中，她童年所受到的都是“棍棒教育”，她家的邻居常常会看见她妈妈拿着棒子，追着她满街打。只有一起玩大的弟弟给了她家庭温暖，所以姐弟两人现在还...(展开全部)', 3700, '3701,3702,3703,3704,3705', '2018-12-28 07:00:17', NULL),
