(891, '卢靖姗 Celina Jade', '女', '双子座', '1985-06-10 00:00:00', '香港', '演员', 'Celina Horan (本名)', 'Celina Jad（卢靖珊）有一张混血儿俏脸，爸爸是美国人，妈妈是中国人，模特、电影演员，集中国、西班牙、英国、法国及印第安血统的混血儿，Celina外表虽然洋化，却自小在港长大，读的是中文学校。大学毕业后，Celina选择加入娱乐圈，实现了当艺人这童年梦想，早前Celina更黟拍吴京首次担任电影《狼牙》女主角，Celina为此秘密练功两个月，在戏内一展身手！　　Celina在港长大，14岁曾到美国生活了半年，可惜当地沉闷，决定返港定居，及后到伦敦大学读书，主修经济管理，毕业后...(展开全部)', 3745, '3746,3747,3748,3749,3750', '2018-12-28 07:00:51', NULL),
