(897, '沈腾 Teng Shen', '男', '天蝎座', '1979-10-23 00:00:00', '中国,黑龙江,齐齐哈尔', '演员 / 配音 / 导演', '', '沈腾，中国内地影视演员、导演、编辑，毕业于解放军艺术学院戏剧表演系。曾出演开心麻花舞台剧《想吃麻花现给你拧》、《乌龙山伯爵》、《索马里海盗》、《甜咸配》等经典话剧，并在主演电影《夏洛特烦恼》、《西虹市首富》、《羞羞的铁拳》等作品中取得了不错的票房成绩；五登央视春晚，带来了小品《扶不扶》、《今天的幸福》、《今天的幸福2》、《投其所好》、《一个女婿半个儿》，都获得了观众的一致好评。参加东方卫视《欢乐喜剧人》第一季并获得冠军，同年首次参加真人秀《...(展开全部)', 3761, '3762,3763,3764,3765,3766', '2018-12-28 07:00:58', NULL),
