(902, '吴昱翰 Yuhan Wu', '男', '巨蟹座', '1986-07-21 00:00:00', '中国,辽宁,鞍山', '导演 / 演员 / 编剧', '', '解放军艺术学院2002级戏剧系的学生，开心麻花签约导演、演员。　　开心麻花导演作品　　音乐剧《爷们儿》　　舞台剧《李茶的姑妈》　　舞台剧《莎士比亚别生气》　　参演电视剧作品　　100集室内情景喜剧《糊涂小天使》饰演——于东东导演：熊 早　　20集电视连续剧《我是一个兵》 饰演——齐亨 导演：朱 翊　　28集电视连续剧《五星饭店》 饰演——王奋斗 导演：刘心刚　　33集电视连续剧《井冈山》 饰演——钟大龙 导演：金 韬　　30集电视连续剧《我是太阳》 饰演...(展开全部)', 3782, '3783,3784,3785,3786,3787', '2018-12-28 07:01:04', NULL);
