(1, '利兹与青鸟 リズと青い鳥', 58, 8.6, '2018-04-21 00:00:00', '剧情 / 动画 / 音乐', '90分钟', 'Liz and the Blue Bird / Liz und ein Blauer Vogel / 莉兹与青鸟 / 劇場版  響け！ユーフォニアム 完全新作 みぞれと希美の物語 / 吹响悠风号全新剧场版1', '日本', '日语', '10,11,8,14,12,3,13,2,4,6,7,5,9', '1', '　　就读北宇治高中的铠塚霙（种崎敦美 配音），在管乐团中负责吹奏双簧管；伞木希美（东山奈央 配音） 则负责吹奏长笛。国中时，希美主动对孤单的霙搭话，从那刻起霙就将希美视为自己的全世界。霙现在每天都感到很幸福，因为有希美在身边陪伴她，但同时也害怕希美是否会再次消失在自己面前……\n                                    <br>\n                                　　身为高三生的两人，即将参加最后一次的音乐竞赛会，自选曲是〈莉兹与青鸟〉，这是一首以童话为蓝本所创作的曲子，为双簧管和长笛共演的独奏曲。「霙是莉兹，希美是青鸟」两人一边将自己的情感投射于童话故事中，一边练习曲子度过不安焦躁的每一天。总是不太契合的齿轮，为了寻求相合的瞬间，而不停地转动著……究竟霙是否能对希美坦露自己真正的烦恼呢？\n                        ', '2018-12-28 06:25:00', NULL),
(2, '唐人街探案2', 151, 6.7, '2018-02-16 00:00:00', '喜剧 / 动作 / 悬疑 / 犯罪', '121分钟', '唐探2 / Detective Chinatown Vol 2', '中国大陆', '汉语普通话', '18,25,16,15,23,17,29,28,21,27,19,20,30,24,26,22', '31', '　　唐仁（王宝强 饰）为巨额奖金欺骗秦风（刘昊然 饰）到纽约参加世界名侦探大赛，然而随着和世界各国侦探们啼笑皆非的较量，两人却发现了隐藏在这次挑战背后的更大秘密...\n                        ', '2018-12-28 06:25:46', NULL),
(3, '一个明星的诞生 A Star Is Born', 242, 7.2, '2018-08-31 00:00:00', '剧情 / 爱情 / 音乐', '135分钟', '一个巨星的诞生(台) / 星梦情深(港)', '美国', '英语', '42,41,44,46,58,33,61,40,65,49,51,50,37,48,64,39,67,56,63,38,55,66,34,52,57,32,35,59,54,43,62,60,36,47,45', '53', '　　在这个全新诠释的悲剧爱情故事中，乡村音乐家杰克·梅恩（布莱德利·库珀 饰）发掘了正在努力熬出头的服务员艾莉（Lady Gaga 饰），当时她正要放弃成为歌手的梦想时，杰克说动她进入演艺界，也在共事的过程中爱上她。不久艾莉的事业起飞，但杰克却克服不了他由来已久的心魔，使两人的关系开始崩裂……\n                                    <br>\n                                　　本片是布莱德利·库珀生平第一次自编、自导、自演，并担任制片，挑战从来没有尝试过的现场演唱与音乐创作的电影。也是Lady Gaga首次挑战大银幕。其在影片中演唱的这些歌曲是由她跟布莱德利·库珀，还有几位艺人一起创作的。所有音乐都是原创和现场录音。\n                        ', '2018-12-28 06:26:42', NULL),
(4, '摘金奇缘 Crazy Rich Asians', 424, 6.2, '2018-11-30 00:00:00', '喜剧 / 爱情', '121分钟', '我的超豪男友(港) / 疯狂亚洲富豪(台) / 疯狂富豪(新) / 疯狂的亚洲富人 / 疯狂的亚洲富豪 / 人疯钱多亚洲豪', '美国', '英语 / 汉语普通话 / 粤语', '91,98,83,107,104,128,92,113,71,117,101,120,112,129,84,115,99,130,76,88,90,123,127,125,114,116,121,97,74,75,108,85,94,70,93,102,68,119,72,122,126,105,69,81,109,132,78,110,96,87,82,73,80,79,131,118,100,86,106,124,111,103,95,89', '77', '　　《摘金奇缘》改编自新加坡作家关凯文畅销全球的小说《疯狂的亚洲富豪》，讲述了美国出生的华裔经济学教授朱瑞秋（吴恬敏 饰）与男友杨尼克（亨利·戈尔丁 饰）一起参加他的好友婚礼时，竟惊讶地发现男友原来是亚洲“钻石王老五”。惊魂未定的瑞秋不仅要面临尼克身边前赴后继的美女攻势，还要直面男友背后错综复杂的豪门恩怨，更有杨紫琼饰演的高傲富家婆婆进行百般阻挠。当朱瑞秋误入名车、派对、珠宝、豪宅萦绕的纸醉金迷的亚洲富豪世界，爱情突现阶级鸿沟，作为现代版“高知灰姑娘”，她能否打好这场爱情保卫战？\n                        ', '2018-12-28 06:27:42', NULL),
(5, '快把我哥带走', 471, 6.9, '2018-08-17 00:00:00', '喜剧 / 奇幻', '115分钟', 'Go Brother! / Take My Brother Away', '中国大陆', '汉语普通话', '136,134,133,137,140,138,135,139', '141', '　　拥有一个每天耍贱整蛊妹妹、毫无家庭感的哥哥是一种什么感受？油炸还是蒸锅？时秒只希望哥哥时分彻底消失！连珍贵的生日愿望都是“快把我哥带走”。不料愿望成真，哥哥变成闺蜜妙妙的哥哥，时秒同情妙妙的同时心里暗爽摆脱“大魔王”！变成独生女的时秒感觉生活无限美好，但却发现时分除了整天和好基友甄开心、万岁插科打诨、整蛊妹妹妙妙之外，还隐藏着不为人知的秘密……\n                        ', '2018-12-28 06:28:20', NULL),
(6, '巨齿鲨 The Meg', 565, 5.8, '2018-08-10 00:00:00', '动作 / 科幻 / 惊悚', '115分钟(中国大陆)', '极悍巨鲨(港) / 麦格', '美国 / 中国大陆 / 香港', '英语 / 汉语普通话 / 泰语', '150,162,143,146,148,147,157,145,156,159,152,158,155,144,151,154,149,153,160,161', '142', '　　一项由中国主导的国际科研项目，正在马里亚纳海沟深处进行时，遭遇未知生物攻击，科研人员被困海底。前美国海军陆战队深海潜水专家乔纳斯·泰勒受命前往营救，再度遭遇数年前曾经在深海给自己留下终身难以磨灭记忆的史前生物巨齿鲨。乔纳斯联手科研项目中的中国女科学家张苏茵成功营救了被困人员，但营救行动却意外造成了巨齿鲨逃离深海。当史前巨兽重返浅海，人类将为自己对大自然的贪婪付出惨重的代价......\n                        ', '2018-12-28 06:29:15', NULL),
(7, '红海行动', 631, 8.3, '2018-02-16 00:00:00', '动作 / 战争', '138分钟', '刀锋·红海行动 / Operation Red Sea', '中国大陆 / 香港', '汉语普通话 / 阿拉伯语 / 英语 / 索马里语 / 粤语', '174,165,171,172,164,170,173,168,163,175,169,166', '167', '　　中东国家伊维亚共和国发生政变，武装冲突不断升级。刚刚在索马里执行完解救人质任务的海军护卫舰临沂号，受命前往伊维亚执行撤侨任务。舰长高云（张涵予 饰）派出杨锐（张译 饰）率领的蛟龙突击队登陆战区，护送华侨安全撤离。谁知恐怖组织扎卡却将撤侨部队逼入交火区，一场激烈的战斗在所难免。与此同时，法籍华人记者夏楠（海清 饰）正在伊维亚追查威廉·柏森博士贩卖核原料的事实，而扎卡则突袭柏森博士所在的公司，意图抢走核原料。混战中，一名隶属柏森博士公司的中国员工成为人质。为了解救该人质，八名蛟龙队员必须潜入有150名恐怖分子的聚集点，他们用自己的信念和鲜血铸成中国军人顽强不屈的丰碑！\n                                    <br>\n                                　　本片根据也门撤侨事件改编。\n                        ', '2018-12-28 06:30:04', NULL),
(8, '蒙上你的眼 Bird Box', 739, 6.9, '2018-12-13 00:00:00', '剧情 / 科幻 / 惊悚', '124分钟', '鸟箱 / 鸟舍', '美国', '英语', '197,180,178,200,176,195,198,188,190,191,194,186,177,183,193,185,181,187,179,184,199,182,192,196', '189', '　　当一股神秘力量要歼灭人类，大家只知道一个法则：万一你看到它，就要奉上自己的性命。面对一切未知，梅乐莉找着爱与希望，以及可以瓦解这股力量的新转机。\n                                    <br>\n                                　　她别无选择，只好带着两个孩子渡过危机四伏的河流，逃往唯一可能安全的地方避难。为了生存下去，他们必须蒙上双眼，踏上长达两天的危险旅程。\n                        ', '2018-12-28 06:32:09', NULL),
(9, '超人总动员2 Incredibles 2', 825, 7.9, '2018-06-22 00:00:00', '喜剧 / 动作 / 动画 / 冒险', '118分钟', '超人特攻队2(台) / 超人特工队2(港) / 超人家族2', '美国', '英语', '214,202,211,201,212,213,207,205,206,215,209,216,204,210,203', '208', '　　超人家族时隔14年强势回归！这次站在聚光灯下的是弹力女超人海伦（霍利·亨特 配音），超能先生巴鲍勃（格雷格·T·尼尔森 配音）则在家照料巴小倩和巴小飞，过起了“正常人”的居家生活。这一角色转换对于每个家庭成员来说都是艰难的，更何况他们都还没意识到宝宝巴小杰的超能力已经悄然增长。当剧中新反派开始酝酿一个狡诈危险的阴谋，超人家族必须联合酷冰侠（塞缪尔·杰克逊 配音）的力量团结对外——然而即使各自都有超能力，真正做起来却是知易行难。\n                        ', '2018-12-28 06:32:40', NULL),
(10, '瞒天过海：美人计 Ocean\'s Eight', 975, 6.7, '2018-06-08 00:00:00', '喜剧 / 犯罪', '110分钟', '女版十一罗汉 / 瞒天过海：八面玲珑(台) / 盗海豪情：8美千娇(港) / 八罗汉 / 八大罗汉 / 侠盗英姿 / 盗海姐妹团 / Ocean’s Ocho / Ocean\'s 8', '美国', '英语 / 印地语 / 法语 / 德语 / 汉语普通话', '226,247,235,233,241,240,232,238,237,243,227,234,223,236,239,219,248,222,244,225,224,245,246,218,242,220,249,221,229,231,228,217', '230', '　　桑德拉·布洛克饰演的Debbie Ocean是《十一罗汉》集团头目乔治·克鲁尼饰演的Danny Ocean的妹妹，曾因盗窃入狱服刑。而黛比刚一出狱就策划惊天大案，与凯特·布兰切特饰演的好友一起网罗顶尖高手，准备在一年一度的时尚盛会Met Gala（纽约大都会艺术博物馆慈善舞会）上盗取由安妮·海瑟薇饰演的大明星所佩戴，价值一亿五千万美金的卡地亚钻石项链。\n                        ', '2018-12-28 06:33:40', NULL),
(11, '宝贝儿', 1000, 5.2, '2018-10-19 00:00:00', '剧情', '96分钟', '宝贝 / Baby', '中国大陆', '汉语普通话', '250,252,253', '251', '　　《宝贝儿》是由侯孝贤监制、刘杰执导的纪实风格文艺片，讲述的是一个因为严重先天缺陷而被父母抛弃的弃儿江萌（杨幂 饰），拯救另一个被父母宣判了“死刑”的缺陷婴儿的故事。\n                                    <br>\n                                　　\n                        ', '2018-12-28 06:34:32', NULL),
(12, '无问西东', 1112, 7.6, '2018-01-12 00:00:00', '剧情 / 爱情 / 战争', '138分钟', 'Forever Young', '中国大陆', '汉语普通话', '269,267,259,266,258,265,274,256,257,275,277,255,271,261,254,268,276,264,260,272,262,273,270', '263', '　　如果提前了解了你所要面对的人生，你是否还会有勇气前来？吴岭澜、沈光耀、王敏佳、陈鹏、张果果，几个年轻人满怀诸多渴望，在四个非同凡响的时空中一路前行。\n                                        <br>\n                                    　　吴岭澜（陈楚生 饰），出发时意气风发，却很快在途中迷失了方向。沈光耀（王力宏 饰），自愿参与了最残酷的战争，他一直在努力去做那些令他害怕，但重要的事。王敏佳（章子怡 饰）最初的错误，只是为了虚荣撒了一个小谎；最初的烦恼，只是在两个优秀的男人中选择一个。但命运，却把她拖入被众人唾骂的深渊。陈鹏（黄晓明 饰）把爱情摆在了理想前面，但爱情却没有把他摆在前面。他说，“我有人要照顾”，纵然这意味着与所有人作对，意味着要和她一起被放逐千里。张果果（张震 饰），身处尔虞我诈的职场，“赢”是他的习惯。为了赢，他总是见招拆招，先发制人。而有一天，他却面临了一个比“赢”更重要的选择。这几个年轻人，在最好的年纪迎来了最残酷的...\n                            ', '2018-12-28 06:35:20', NULL),
(13, '死侍2 Deadpool 2', 1263, 7.5, '2018-05-18 00:00:00', '喜剧 / 动作 / 科幻 / 冒险', '119分钟', '死侍往事 / DP2 / Once Upon a Deadpool', '美国', '英语', '306,299,307,305,281,301,309,284,292,286,283,289,297,288,294,295,300,287,308,279,293,290,302,282,303,285,304,280,291,278,296', '298', '　　漫威史上最贱的雇佣兵死侍再度归来！本与女友过着幸福生活的死侍（瑞安·雷诺兹 饰）上门寻仇，美好生活岌岌可危。然而悲惨的日子还没结束，死侍还和想要接纳他的X战警剪不断，理还乱。就在这位平日里插科打诨的英雄人生跌入谷底之时，一位强大的时空穿越者——电索（乔什·布洛林 饰）却盯上了死侍想要保护的少年。为迎强敌，死侍广发英雄帖，临时组建了X特攻队。就凭他们真的能打过这位来自未来的敌人么？\n                        ', '2018-12-28 06:36:17', NULL),
(14, '皇家酒店谋杀案 Bad Times at the El Royale', 1364, 6.9, '2018-09-27 00:00:00', '剧情 / 悬疑 / 惊悚 / 犯罪', '141分钟', '皇家酒店的悲惨时光 / 坏事大饭店(台) / 贼眉贼眼大酒店(港)', '美国', '英语', '320,330,311,327,329,323,315,317,321,325,319,328,318,310,313,322,312,316,324,326', '314', '　　故事围绕上世纪60年代，七个心怀秘密的陌生人，在一个破旧的有着黑暗历史的皇家酒店相遇。在宿命之夜，每个人紧握最后的机会。\n                        ', '2018-12-28 06:36:58', NULL),
(15, '头号玩家 Ready Player One', 1448, 8.7, '2018-03-30 00:00:00', '动作 / 科幻 / 冒险', '140分钟', '玩家一号 / 挑战者1号(港) / 一级玩家(台) / 一号玩家', '美国', '英语 / 日语 / 汉语普通话', '343,340,338,347,346,332,341,336,337,339,334,342,331,345,344,333', '335', '　　故事发生在2045年，虚拟现实技术已经渗透到了人类生活的每一个角落。詹姆斯哈利迪（马克·里朗斯 Mark Rylance 饰）一手建造了名为“绿洲”的虚拟现实游戏世界，临终前，他宣布自己在游戏中设置了一个彩蛋，找到这枚彩蛋的人即可成为绿洲的继承人。要找到这枚彩蛋，必须先获得三把钥匙，而寻找钥匙的线索就隐藏在詹姆斯的过往之中。\n                                    <br>\n                                　　韦德（泰尔·谢里丹 Tye Sheridan 饰）、艾奇（丽娜·维特 Lena Waithe 饰）、大东（森崎温 饰）和修（赵家正 饰）是游戏中的好友，和之后遇见的阿尔忒弥斯（奥利维亚·库克 Olivia Cooke 饰）一起，五人踏上了寻找彩蛋的征程。他们所要对抗的，是名为诺兰索伦托（本·门德尔森 Ben Mendelsohn 饰）的大资本家。\n                        ', '2018-12-28 06:37:46', NULL),
(16, '幸福的拉扎罗 Lazzaro felice', 1492, 8.6, '2018-05-13 00:00:00', '剧情 / 奇幻', '125分钟', '睡王子的快乐传说(港) / Happy as Lazzaro', '意大利 / 瑞士 / 法国 / 德国', '意大利语', '356,349,358,353,351,348,357,350,354,355,359', '352', '　　拉扎罗（阿德里亚诺·塔尔迪奥洛 饰）是一位内心单纯的年轻农民，坦克雷迪（卢卡·奇科瓦尼 饰）则是一位骄横的年轻贵族。他在Inviolata这座与世隔绝的小城内生活，这个城镇则由侯爵夫人阿诺西纳·德·卢娜（尼可莱塔·布拉斯基 饰）所统治。年轻的农民和年轻的贵族相遇并成为好友。某天，坦克雷迪出于玩乐的目的，自导自演了绑架闹剧，并向拉扎罗求助。拉扎罗非常珍视这段真诚且快乐的友谊，他决定穿越时空，回到小城，以寻找坦克雷迪。\n                        ', '2018-12-28 06:38:15', NULL),
(17, '胖子行动队', 1569, 4.1, '2018-09-30 00:00:00', '喜剧 / 动作', '108分钟', 'Fat Buddies', '中国大陆', '汉语普通话', '360,363,362,371,372,370,367,361,373,365,368,369,366', '364', '　　特工“J”（文章 饰）在执行一次A级任务时头部中枪，导致颅内下丘脑受损。养伤期间，J渐渐变成了一个三百斤的大胖子，并患有严重的嗜睡症，但J依然认为自己是一个王牌特工。终于，J再次接到任务，只身前往日本取回机密文件。文件得手后，J却擅自拆开文件决定替组织继续完成隐藏其中的任务，不料却晕倒在居酒屋。医院醒来的J结识了保安郝英俊（包贝尔 饰），郝英俊为了证明自己不是个一事无成的废物毅然决然地加入任务中。这对临时拍档在执行任务的过程中，经历一次又一次令人啼笑皆非、险象环生的危机......\n                        ', '2018-12-28 06:38:49', NULL),
(18, '动物世界', 1607, 7.3, '2018-06-29 00:00:00', '剧情 / 动作 / 冒险', '132分钟', '赌博默示录中国版 / Animal World', '中国大陆', '汉语普通话 / 英语', '378,375,380,376,374,377', '379', '　　在游戏机厅做着兼职“小丑”的郑开司（李易峰 饰），幼时父亲突然失踪，母亲重病住院，使得郑开司的生活非常拮据。发小“大虾米”（曹炳琨 饰）借口买房骗下了郑开司父亲留下的房产，还给他带来了巨额的欠债。神秘人物（迈克尔·道格拉斯 Michael Douglas 饰）出现，告诉郑开司，只要参加“命运号”游轮上的神秘游戏，就有机会偿还完所有欠款，一无所有的郑开司为了给青梅竹马的护士刘青（周冬雨 饰）和母亲更好的生活，只得登上游轮，开始了生存游戏，一场以“剪刀、石头、布”展开的生死较量即将登场……\n                        ', '2018-12-28 06:39:30', NULL),
(19, '解除好友：暗网 Unfriended: Dark Web', 1650, 7.9, '2018-03-09 00:00:00', '恐怖 / 犯罪', '92分钟', '杀讯2(台) / 解除好友2', '美国', '英语', '381,386,383,390,382,391,388,385,392,384,387', '389', '　　马迪亚斯（科林·伍德尔 Colin Woodell 饰）的女友阿玛雅（斯蒂芬妮·诺格拉斯 Stephanie Nogueras 饰）是一名聋哑人，为了能够和阿玛雅顺利的交流，马迪亚斯煞费苦心，然而两人之间的关系却还是每况愈下，这让马迪亚斯的内心有着隐隐的不安。\n                                    <br>\n                                　　一天，马迪亚斯在一家咖啡店里捡到了一台笔记本电脑，鬼使神差之下，马迪亚斯将电脑带回了家，通过电脑里保存的用户名和密码，马迪亚斯登录了电脑主人的个人主页，发现这似乎是一个不学无术的花花公子。马迪亚斯通过这台电脑和好友莎伦娜（瑞贝卡·瑞滕豪斯 Rebecca Rittenhouse 饰）、达蒙（安德鲁斯·李斯 Andrew Lees 饰）、娜丽（贝蒂·加布里埃尔 Betty Gabriel 饰）等人联机视频，随着时间的推移，他们渐渐发现了隐藏在这台电脑里的可怕的秘密。\n                        ', '2018-12-28 06:40:09', NULL),
(20, '悲伤逆流成河', 1682, 5.8, '2018-09-21 00:00:00', '剧情 / 爱情', '104分钟', '悲伤逆流成河电影版 / Cry Me a Sad River', '中国大陆', '汉语普通话', '397,395,394,393,398', '396', '　　多组校园欺凌事件，打破了5位主角本应该美好的青春校园生活。齐铭（赵英博 饰）清俊帅气，是人人称颂的优等生，而易遥（任敏 饰）却是大家口中的“赔钱货”。两人一同长大，感情很好。而这一切，在转学生唐小米（朱丹妮 饰）出现之后发生了翻天覆地的变化。流言成了毁人利器，处处对易瑶进行刁难，易遥的生活开始陷入黑暗，遭受各类残酷欺凌。顾森西（辛云来 饰）教会易瑶对校园暴力进行反击，他的出现给了易遥一丝曙光。可阴差阳错，顾森湘（章若楠 饰）的意外却将她再度推入黑暗。当受害者变成施暴者，当看客变成助推，在这一场名为“玩笑”的闹剧中，没有旁观者，只有施暴者……\n                        ', '2018-12-28 06:40:39', NULL),
(21, '江湖儿女', 1761, 7.6, '2018-09-21 00:00:00', '爱情 / 犯罪', '137分钟(中国大陆)', '金钱与爱情 / 灰烬是最洁白的 / Ash is Purest White / Money & Love / Les Eternels', '中国大陆 / 法国 / 日本', '汉语普通话 / 山西方言 / 湖北方言 / 重庆方言', '412,400,402,407,406,411,401,409,404,403,413,416,399,408,410,405,415', '414', '　　故事开始于2001年的山西大同，巧巧（赵涛 饰）和斌斌（廖凡 饰）相恋多年，巧巧一心希望能够和斌斌成家过安稳的生活，但斌斌身为当地的大佬，有着自己更高远的志向。一场意外中，斌斌遭人暗算危在旦夕，巧巧拿着斌斌私藏的手枪挺身而出救了斌斌，自己却因为非法持枪而被判处了五年的监禁。\n                                    <br>\n                                　　一晃眼五年过去，出狱后的巧巧发现整个世界都发生了翻天覆地的变化，唯一不变的是她对斌斌真挚的感情。巧巧跋山涉水寻找斌斌的下落，但此时的斌斌早已经失去了往日的锋芒，而且身边已有了新的女友。身无分文的巧巧靠着自己的智慧摸爬滚打，终于为自己挣得了一片天地。\n                        ', '2018-12-28 06:41:34', NULL),
(22, '燃烧 버닝', 1796, 7.9, '2018-05-16 00:00:00', '剧情 / 悬疑', '148分钟', '烧失乐园(港) / 燃烧烈爱(台) / Burning / Beoning', '韩国', '韩语', '420,423,421,418,422,419', '417', '　　目标成为作家的青年李钟秀（刘亚仁 饰），平日里靠兼职养活自己。经营畜牧业的父亲不谙人情，官司缠身，迫使钟秀又要为了搭救父亲而四处奔走。这一日，钟秀在某大型卖场重逢了当年的同学申惠美（全钟淑 饰）。惠美计划近期前往非洲旅行，于是拜托钟秀照看爱猫Boil。不久后惠美回国，与之一同下飞机的还有名叫本（史蒂文·元 饰）的男子。本驾驶保时捷，居住在高级公寓内，优哉游哉，不见工作，四处玩乐，和钟秀相比有如天上地下。不知为何，本走入平民钟秀和惠美的生活，更向新朋友讲述了他奇特的癖好。在钟秀家小聚的那个晚上过后，惠美仿佛人间蒸发了一般无影无踪……\n                                    <br>\n                                　　本片根据村上春树的短篇小说《烧仓房》改编。\n                        ', '2018-12-28 06:42:30', NULL),
(23, '银魂2 銀魂2 掟は破るためにこそある', 1912, 7.5, '2018-08-17 00:00:00', '喜剧 / 动作 / 冒险', '135分钟', '银魂2：规则是用来打破的 / 规定就是为了被打破而存在的 / Gintama 2', '日本', '日语', '439,429,425,426,424,437,441,438,431,433,442,443,440,432,436,435,430,427,428', '434', '　　11月16日，真人版《银魂》在东京举行蓝光&DVD发售活动，主办方在现场宣布将制作真人版《银魂》续集，并暂时命名为《银魂 PART2》，此外还宣布真人版《银魂》的蓝光&DVD将于11月22日发售。小栗旬现场表示：“（第二部）最好我的出场时间可以少一点，福田小姐（编剧）如果能给我不太需要出演的剧本就太好了！”\n                        ', '2018-12-28 06:43:14', NULL),
(24, '登月第一人 First Man', 2007, 7.6, '2018-08-29 00:00:00', '剧情 / 传记 / 历史', '141分钟', '第一人 / 登月先锋(台) / 爱月之人(豆友译名)', '美国', '英语', '459,447,444,458,452,451,460,454,448,450,456,455,446,445,457,453', '449', '　　影片将聚焦美国传奇宇航员尼尔·阿姆斯特朗的生平，重点讲述他在1961-1969年间成为人类历史上第一个登月者的过程，同时也展现出人类在这次史上最危险的宇宙探索征途中所付出的难以想象的国家与个体牺牲。\n                                    <br>\n                                　　影片根据詹姆斯·汉森的传记作品《第一人：尼尔·阿姆斯特朗的人生》改编而成。\n                                    <br>\n                                　　尼尔·阿姆斯特朗，是人类历史上首位登上月球的宇航员。他1930年出生，2012年逝世，是美国阿波罗11号登月计划宇航员。在美国航空航天局服役时，阿姆斯特朗于1969年7月21日成为了第一个踏上月球的宇航员，也是第一个在地球外星体上留下脚印的人类成员。\n                        ', '2018-12-28 06:44:10', NULL),
(25, '爱你，西蒙 Love, Simon', 2119, 8.3, '2018-03-16 00:00:00', '爱情 / 同性', '110分钟', '亲爱的初恋(台) / 抱抱我的初恋(港) / 西蒙和他的出柜日记 / 爱你的西蒙 / 爱，赛蒙', '美国', '英语', '491,467,486,479,476,463,475,474,487,480,485,484,471,461,482,464,462,473,483,478,488,465,493,466,470,492,489,481,477,472,490,469', '468', '　　每个人都值得拥有一个伟大的爱情故事。但是对一个17岁的高中生「赛门」来说这一切却是件超複杂的事：第一、没有人知道他是同性恋；第二、他也搞不清楚自己爱上跟他一样有同样困扰的不具名网友到底是何方神圣？？？为了解决这两个大麻烦，赛门展开一段爆笑又吓人的解答过程，但他没料到的是，最后得到的答案却从此改变了自己的人生。\n                        ', '2018-12-28 06:44:43', NULL),
(26, '名侦探柯南：零的执行人 名探偵コナン ゼロの執行人', 2152, 5.8, '2018-11-09 00:00:00', '动画 / 悬疑', '110分钟', '名侦探柯南：零之执行人 / 名侦探柯南2018 / Detective Conan: Zero the Enforcer / Meitantei Conan: Zero no Shikkônin / 名侦探柯南剧场版2018', '日本', '日语', '496,498,495,499,500,494,501,502', '497', '　　一场大规模的恐怖袭击，一个牵扯无数内幕的神秘组织，这个关乎整个东京的可怕计划即将拉开帷幕…首脑云集的东京峰会举办在即，会场突然发生超大规模的爆炸事件，不仅在现场发现行踪诡异的安室透，毛利小五郎更是惨遭陷害。面对最危险任务，最烧脑的推理，最艰难的博弈，柯南能否在迷雾中寻找到唯一的真相。\n                                    <br>\n                                　　\n                        ', '2018-12-28 06:45:31', NULL),
(27, '特工 공작', 2178, 8.4, '2018-05-11 00:00:00', '剧情', '137分钟', '北风(台) / 北寒谍战(港) / 工作 / The Spy Gone North / Gongjak', '韩国', '韩语 / 汉语普通话 / 日语', '504,507,503,505', '506', '　　1990年代中期，暗号「黑金星」的南韩「国家安全企划部」情报员，假扮成南韩商人跟北韩进行商业交易，藉此渗透北韩军事单位，打探核开发情报，他得在最危险的地方，赢得敌方的信任，没想到一心只想完成任务的他，却在不自觉中陷入南北韩权力高层间的恐怖阴谋。\n                        ', '2018-12-28 06:46:28', NULL),
(28, '昨日青空', 2196, 6.1, '2018-10-26 00:00:00', '爱情 / 动画', '82分钟', 'Crystal Sky of Yesterday', '中国大陆', '汉语普通话', '510,508,512,511,509', '513', '　　中国首部青春题材动画电影《昨日青空》将于2018年暑期全国上映。该片改编自口袋巧克力同名人气漫画作品，由咕咚导演奚超执导。影片以中国南方小镇兰溪为实际取景地，讲述了小镇上的几位高三学生，有关梦想、友谊、亲情和初恋等的成长经历，描绘出一段极具中国风、清新唯美的青春故事。\n                        ', '2018-12-28 06:47:14', NULL),
(29, '复仇者联盟3：无限战争 Avengers: Infinity War', 2412, 8.1, '2018-05-11 00:00:00', '动作 / 科幻 / 奇幻 / 冒险', '150分钟', '复仇者联盟3：无限之战(港) / 复仇者联盟：无限之战(台) / 复仇者联盟3：无尽之战 / 复联3 / 妇联3(豆友译名) / 复仇者联盟3：灭霸传(豆友译名) / Avengers: Infinity War - Part I / The Avengers 3: Part 1', '美国', '英语', '543,520,546,549,536,551,514,519,524,533,530,538,542,547,531,537,529,528,518,535,532,517,515,550,516,539,544,541,523,526,545,540,522,521,534,527,548,525', '552', '　　最先与灭霸军团遭遇的雷神索尔一行遭遇惨烈打击，洛基遇害，空间宝石落入灭霸之手。未几，灭霸的先锋部队杀至地球，一番缠斗后掳走奇异博士。为阻止时间宝石落入敌手，斯塔克和蜘蛛侠闯入了敌人的飞船。与此同时，拥有心灵宝石的幻视也遭到外星侵略者的袭击，为此美国队长、黑寡妇等人将其带到瓦坎达王国，向黑豹求助。幸免于难的索尔与星爵一行相逢，随后他们兵分两路。索尔与火箭、格鲁特踏上再铸雷神之锤的旅程，星爵则与卡魔拉等人试图阻止灭霸的恶行。而知晓灵魂宝石下落的卡魔拉，同样是其义父灭霸追踪的对象。\n                                    <br>\n                                　　攸关整个宇宙命运的史诗战役全面展开，超级英雄们为了平凡而自由的生命奋不顾身……\n                        ', '2018-12-28 06:48:13', NULL),
(30, '巴斯特·斯克鲁格斯的歌谣 The Ballad of Buster Scruggs', 2513, 8.4, '2018-08-31 00:00:00', '喜剧 / 歌舞 / 西部', '132分钟', '巴斯特民谣 / 巴斯特的歌谣 / 西部老巴的故事(台) / 细说当年话西部(港)', '美国', '英语', '569,576,559,570,573,572,557,564,553,558,575,556,555,563,580,565,561,579,560,566,568,577,571,567,562,581,578,574', '554', '　　《巴斯特·斯克鲁格斯的歌谣》（The Ballad Of Buster Scruggs）讲述一个喜欢唱歌跳舞的神枪手以一种无敌的姿态一路杀一路唱一路跳，但最终遇上了旗鼓相当的对手的故事。\n                                        <br>\n                                    　　《阿尔戈多内斯附近》（Near Algodones）讲述一位生活在高平原之上的流浪者因为自己一无所有虚度光阴而决定抢劫银行的故事。\n                                        <br>\n                                    　　《饭票》（Meal Ticket）讲述一个流动剧团的经理和一个没有四肢的残疾人“艺术家”之间的故事。\n                                        <br>\n                                    　　《黄金谷》（All Gold Canyon）讲述一名教授因发现一座金矿而欣喜若狂，又因为随即到来的邪恶侵占势力而面临险境的故事。\n                                        <br>\n                                    　　《受惊女子》（The Gal Who Got Rattled）讲述一名乘坐马车的女人需要两位俄勒冈小道的工头其中一人的帮助，并且将其当作潜在结婚对象加以考察的故事。\n                                        <br>\n                                    　　《遗体》（The Mortal Remai...\n                            ', '2018-12-28 06:49:11', NULL),
(31, '一个小忙 A Simple Favor', 2605, 7.1, '2018-09-14 00:00:00', '剧情 / 悬疑 / 犯罪', '117分钟', '简单帮个忙 / 举手之劳 / 失踪网红(台) / 小心帮忙(港)', '美国 / 加拿大', '英语', '601,587,595,582,607,585,584,592,597,603,589,583,590,606,593,602,586,600,596,591,608,599,604,605,594,598', '588', '　　故事讲述一博主史蒂芬娜偶遇艾米丽，两人迅速成为好友，而当艾米丽请求史蒂芬娜帮助她接孩子时，艾米丽却突然消失了。一切似乎很不寻常。 本片根据达塞·贝尔同名小说改编。\n                        ', '2018-12-28 06:49:50', NULL),
(32, '此房是我造 The House That Jack Built', 2665, 7.6, '2018-05-14 00:00:00', '剧情 / 惊悚 / 犯罪', '152分钟', '此房杰克造 / 杰克盖的房子(台)', '丹麦 / 法国 / 德国 / 瑞典', '英语 / 德语 / 意大利语', '612,611,614,609,618,619,616,613,610,615', '617', '　　1970年代，美国。导演通过长达12年的时间跨度，通过多件谋杀案展示了Jack这位高智商连环杀手的心路演变。全片围绕Jack的视角展开。在他眼中，他的每次谋杀都堪称一件艺术作品。随着警察的调查迫近，他每次犯案都要承受越来越大的风险，以打造出自己心目中的终极艺术品。通过与一位名叫Verge的陌生人的反复对话，我们得以逐渐了解Jack对谋杀的艺术性诠释，这是一种残酷与高雅的交融，一种近乎孩童的自我怜悯，也是他精神变态的缘由。《The House That Jack Built》以一种哲学式的，有时乃至诙谐的叙述手法讲述了一段阴郁残虐的故事。\n                        ', '2018-12-28 06:50:41', NULL),
(33, '大象席地而坐', 2716, 8.1, '2018-02-16 00:00:00', '剧情', '230分钟(导演剪辑版)', '金羊毛 / 爱在樱花盛开时 / An Elephant Sitting Still', '中国大陆', '汉语普通话', '629,626,628,630,624,621,631,623,627,620,625', '622', '　　满州里动物园有一头大象，每天坐在那里。为朋友出头的少年、为弟报仇的恶霸哥哥、身陷囹圄的女生，卡在世界灰暗的缝隙里无法脱身，却挣扎着去看大象。萧瑟寒冬的一天，绝望身影在不对称不平衡的影像中碰撞， 爆裂了压抑的沉郁，在粗糙布景、朦胧灯光的低成本制作中肆意蔓延。作者兼导演胡波 （笔名胡迁）首作，以青涩朴质与震撼感性，获柏林影展赏识入围论坛单元， 却是无法嵌合和谐主旋律的一块失落拼图。看不见大象是共同宿命，胡波骤然陨落，也成了这一代人的遗憾。\n                        ', '2018-12-28 06:51:11', NULL),
(34, '憨豆特工3 Johnny English Strikes Again', 2767, 6.5, '2018-11-23 00:00:00', '喜剧 / 动作 / 冒险', '89分钟', '凸槌特派员3(台) / 特务戆J：神级归位(港) / 憨豆特工再出击 / Johnny English 3', '法国 / 美国 / 英国', '英语', '646,639,642,644,643,633,634,638,632,641,645,636,640,635', '637', '　　《憨豆特工3》是憨豆特工系列喜剧的第三部作品，罗温·艾金森再度回归，继续扮演大受欢迎的阴差阳错入行的特工强尼。这次的新冒险由一场黑客攻击拉开序幕，所有在职的特工都被暴露了身份，使得强尼成为情报处最后的救命稻草。因此获得“返聘”的强尼第一个出勤任务便是要找出这位超强 黑客 。木头木脑、技能堪忧的强尼将如何应对现代科技的挑战，成功完成任务呢？\n                        ', '2018-12-28 06:52:02', NULL),
(35, '找到你', 2815, 7.4, '2018-10-05 00:00:00', '剧情', '102分钟', '谜踪 / Lost, Found', '中国大陆', '汉语普通话', '647,651,650,655,653,648,654,649', '652', '　　律师李捷（姚晨 饰）正在离婚进行时，与前夫争夺女儿抚养权，拼命工作为给孩子最好的生活，幸有保姆孙芳（马伊琍 饰）帮忙照顾孩子视如己出。                                                                                  一日下班，李捷发现保姆孙芳和女儿毫无预兆地消失了，她内心最大的恐惧变成了现实。在追寻孙芳和女儿的下落时，她收到来自家人的谴责声讨，甚至遭到警方的怀疑。几乎崩溃的李捷，靠着惊人的勇气，踏上独自寻访的旅 程。在追踪过程中，李捷逐渐接近了另一个女人——保姆孙芳的人生故事，她的身份原先都是谎言，而真相也将浮出水面……\n                        ', '2018-12-28 06:52:56', NULL),
(36, '罗马 Roma', 2844, 8.1, '2019-01-31 16:00:00', '剧情 / 家庭', '135分钟', 'México \'68', '墨西哥 / 美国', '西班牙语 / 米斯特克语 / 英语', '658,665,668,656,660,659,664,661,662,657,663,667', '666', '　　故事发生在墨西哥城的一个中产阶级社区“罗马”，讲述年轻女佣克里奥（雅利扎·阿巴里西奥饰）在雇主索菲亚（玛丽娜·德·塔维拉饰）家中工作，该家中索菲亚的丈夫长期在外，由女佣克里奥照顾索菲的四个孩子。突如其来的两个意外，同时砸中了女佣克里奥和雇主索菲亚，两人究竟该如何面对苦涩茫然的生活？四位孩子似乎是希望所在。 这是以导演阿方索·卡隆的儿时记忆铸成的影片，而卡隆其实就是片中某一位小孩。\n                        ', '2018-12-28 06:53:46', NULL),
(37, '蚁人2：黄蜂女现身 Ant-Man and the Wasp', 2988, 7.3, '2018-08-24 00:00:00', '动作 / 科幻 / 冒险', '118分钟', '蚁侠2：黄蜂女现身(港) / 蚁人2 / 蚁人与黄蜂女 / Ant-Man 2', '美国', '英语', '675,674,695,688,699,700,693,706,679,671,711,684,707,689,680,697,669,687,714,702,682,708,691,709,701,694,670,683,698,685,681,712,678,677,676,696,686,705,710,713,690,703,704,692,672', '673', '　　来自漫威电影宇宙的新片《蚁人2：黄蜂女现身》重点展现了两位超级英雄令人惊叹的收缩能力。继《美国队长3》的故事线之后，斯科特·朗迎来了自己作为超级英雄和孩子父亲的双重身份。一方面，他在背负着蚁人职责的同时努力过好自己的生活；另一方面，二代黄蜂女霍普·凡·戴恩和汉克·皮姆博士又向他传达了一项紧迫的新任务。斯科特必须再次穿上战衣，与黄蜂女并肩作战，共同破解来自过去的谜题。\n                        ', '2018-12-28 06:54:28', NULL),
(38, '碟中谍6：全面瓦解 Mission: Impossible - Fallout', 3120, 8.1, '2018-08-31 00:00:00', '动作 / 惊悚 / 冒险', '147分钟', '碟中谍6 / 不可能的任务：全面瓦解(台) / 职业特工队：叛逆之谜(港) / Mission: Impossible 6 / MI6', '美国', '英语 / 法语', '722,721,727,738,734,724,729,745,715,719,737,720,740,728,732,744,731,733,743,746,736,718,735,742,723,726,730,741,739,725,717', '716', '　　伊森·亨特（汤姆·克鲁斯饰）和队友们接到了追回三个大杀伤性核武器的任务。眼见任务马上就能完成，但为了挽救其中一位队友卢瑟（文·瑞姆斯饰）的生命，三个核武器被人趁机带走。中情局负责人斯隆女士（安吉拉·贝塞特饰）调来她手下的得意猛将沃克（亨利·卡维尔饰），让他盯着伊森·亨特完成追回核武器的任务。期间，女特工伊尔莎（丽贝卡·弗格森饰）突然出现，伊森·亨特发现，他要面对的并不只是恐怖分子，还有潜藏在政府部门的内鬼。\n                        ', '2018-12-28 06:55:12', NULL),
(39, '西虹市首富', 3225, 6.6, '2018-07-27 00:00:00', '喜剧', '118分钟', 'Hello Mr. Billionaire', '中国大陆', '汉语普通话', '752,762,768,747,771,772,769,765,754,770,751,760,775,748,764,774,753,766,749,750,755,763,767,761,757,773,758,759', '756', '　　西虹市丙级球队大翔队的守门员王多鱼（沈腾 饰）因比赛失利被教练开除，一筹莫展之际王多鱼突然收到神秘人士金老板（张晨光 饰）的邀请，被告知自己竟然是保险大亨王老太爷（李立群 饰）的唯一继承人，遗产高达百亿！但是王老太爷给出了一个非常奇葩的条件，那就是要求王多鱼在一个月内花光十亿，还不能告诉身边人，否则失去继承权。王多鱼毫不犹豫签下了“军令状”，与好友庄强（张一鸣 饰）以及财务夏竹（宋芸桦 饰）一起开启了“挥金之旅”，即将成为西虹市首富的王多鱼，第一次感受到了做富人的快乐，同时也发现想要挥金如土实在没有那么简单！\n                        ', '2018-12-28 06:56:19', NULL),
(40, '邪不压正', 3289, 7, '2018-07-13 00:00:00', '剧情 / 喜剧 / 动作', '137分钟', '侠隐 / Hidden Man', '中国大陆', '汉语普通话 / 英语 / 日语 / 法语', '787,783,780,778,782,785,776,777,781,786,784', '779', '　　七七事变前夕，华裔青年小亨德勒（彭于晏 饰）从美国远赴重洋，回到阔别十数年之久的北平从医。然而他真正的名字叫李天然，十三岁那年曾亲眼目睹师父一家遭师兄朱潜龙（廖凡 饰）和日本人根本一郎（泽田谦也 饰）灭门。侥幸逃生的天然被美国人亨德勒医生送往大洋彼岸，接受了极其严苛的训练，而今他怀着绝密的任务踏上故土。亨德勒父子租住神秘男子蓝青峰（姜文 饰）的宅子，蓝是当年辛亥革命的参与者，他与现为警察局长的朱潜龙过从甚密，却又以杀死李天然为筹码，暗中怂恿朱除掉根本一郎。复仇心切的李天然寻找到了仇人，而亨德勒医生则全力阻止养子冒险。在这一过程中，交际花唐凤仪（许晴 饰）与裁缝关巧红（周韵 饰）也卷入了男人的勾心斗角的漩涡里。直到七七事变爆发，所有的矛盾迎来了决断的时刻……\n                                    <br>\n                                　　本片根据张北海的小说《侠隐》改编。\n                        ', '2018-12-28 06:57:14', NULL),
(41, '神奇动物：格林德沃之罪 Fantastic Beasts: The Crimes of Grindelwald', 3467, 7.2, '2018-11-16 00:00:00', '奇幻 / 冒险', '134分钟', '神奇动物在哪里2：格林德沃之罪 / 怪兽与葛林戴华德之罪(港) / 怪兽与葛林戴华德的罪行(台) / 神奇动物在哪里2 / 神奇动物2 / Fantastic Beasts and Where to Find Them 2', '美国 / 英国', '英语', '801,830,788,795,806,794,810,791,821,832,831,807,833,798,799,802,816,834,792,814,811,820,805,797,812,825,809,808,829,826,815,827,817,819,793,804,789,800,818,790,796,823,828,824,803,822', '813', '　　虽然纽特（埃迪·雷德梅恩 Eddie Redmayne 饰）协助美国魔法部将邪恶的黑巫师格林德沃（约翰尼·德普 Johnny Depp 饰）捉拿归案，但最终格林德沃还是逃脱了禁锢，他来到了法国巴黎，一是为了集结信徒掀起革命，二十为了寻找同样藏匿在这里的克雷登斯（埃兹拉·米勒 Ezra Miller 饰），寄生在克雷登斯身上的默默然是帮助格林德沃实现野心的不可或缺的道具。\n                                        <br>\n                                    　　格林德沃的潜逃在整个魔法世界里都掀起了轩然大波，一时间草木皆兵。邓布利多（裘德·洛 Jude Law 饰）秘密的找到了纽特，希望他能够前往巴黎，先格林德沃一步找到克雷登斯。和纽特一起踏上巴黎之旅的，是麻鸡雅各布（丹·福格勒 Dan Fogler 饰），他此行的目的，是要找回先前因为吵架而来到巴黎投奔姐姐蒂娜（凯瑟琳·沃特森 Katherine Waterston 饰）的恋人奎妮（艾莉...\n                            ', '2018-12-28 06:57:54', NULL),
(42, '我不是药神', 3564, 9, '2018-07-05 00:00:00', '剧情 / 喜剧', '117分钟', '中国药神 / 印度药神 / 印度药商 / 生命之路 / Dying to Survive / Drug Dealer', '中国大陆', '汉语普通话 / 英语 / 上海话 / 印地语', '835,843,842,838,851,849,853,844,848,839,836,847,846,850,840,854,852,837,841', '845', '　　普通中年男子程勇（徐峥 饰）经营着一家保健品店，失意又失婚。不速之客吕受益（王传君 饰）的到来，让他开辟了一条去印度买药做“代购”的新事业，虽然困难重重，但他在这条“买药之路”上发现了商机，一发不可收拾地做起了治疗慢粒白血病的印度仿制药独家代理商。赚钱的同时，他也认识了几个病患及家属，为救女儿被迫做舞女的思慧（谭卓 饰）、说一口流利“神父腔”英语的刘牧师（杨新鸣 饰），以及脾气暴烈的“黄毛”（章宇 饰），几个人合伙做起了生意，利润倍增的同时也危机四伏。程勇昔日的小舅子曹警官（周一围 饰）奉命调查仿制药的源头，假药贩子张长林（王砚辉 饰）和瑞士正牌医药代表（李乃文 饰）也对其虎视眈眈，生意逐渐变成了一场关于救赎的拉锯战。\n                                    <br>\n                                　　本片改编自慢粒白血病患者陆勇代购抗癌药的真实事迹。\n                        ', '2018-12-28 06:58:29', NULL),
(43, '影', 3624, 7.3, '2018-09-30 00:00:00', '剧情 / 动作 / 武侠 / 古装', '116分钟', '三国·荆州 / 荆州保卫战 / Shadow', '中国大陆 / 香港', '汉语普通话', '861,863,859,858,862,857,860,856,864', '855', '　　纷乱时局，群敌环伺。一个从小被秘密囚禁的替身，不甘只做他人手中的武器；但若想冲破枷锁，找回自我，又必将历经千难万险的考验；替身能否寻回自由，他又该如何选择？\n                                    <br>\n                                　　\n                        ', '2018-12-28 06:59:28', NULL),
(44, '一出好戏', 3706, 7.1, '2018-08-10 00:00:00', '剧情 / 喜剧', '134分钟', '大富翁 / 诳想曲 / The Island', '中国大陆', '汉语普通话', '876,879,878,875,868,867,866,870,877,865,872,874,871,869', '873', '　　马进欠下债务，与远房表弟小兴在底层社会摸爬滚打，习惯性的买彩票，企图一夜暴富，并迎娶自己的同事姗姗。一日，公司全体员工出海团建，途中，马进收到了彩票中头奖的信息，六千万！就在马进狂喜自己翻身的日子终于到来之际，一场突如其来的滔天巨浪打破了一切。苏醒过来的众人发现身处荒岛 ，丧失了一切与外界的联系……\n                        ', '2018-12-28 07:00:17', NULL);
